boksen - kan vi få til noe tilsvarende?\n','2014-05-05 17:18:03'),(36,1,2,'ja','2014-05-05 17:18:27'),(37,1,2,'\nden jeg laget tidligere er slik, tor jeg, ','2014-05-05 17:18:42'),(38,1,2,'\nskal fine kindekoden og prøve å plugge inn','2014-05-05 17:18:56'),(39,1,2,'\nmen den bruker egen server for chat - ','2014-05-05 17:19:15'),(40,2,2,'\ndet bør også gi en notification til bruker om at har mottatt message','2014-05-05 17:19:22'),(41,1,2,'\nNode.js','2014-05-05 17:19:23'),(42,1,2,'\ndet jeg nevnet tidligere - må bare kjøre oppsett 1st','2014-05-05 17:19:38'),(43,2,2,'\nok...hva er positivt / negativt med å ha egen server for chat? hvordan påvirker det systemet og bruker opplevelsen?','2014-05-05 17:19:48'),(44,1,2,'\nden jeg jeg snakker om nå får vindu å spåvne og blinke','2014-05-05 17:20:01'),(45,1,2,'ikek noe negativt\n','2014-05-05 17:20:14'),(46,1,2,'\nfaktisk bedre - mindre load på BuddyPress core','2014-05-05 17:20:28'),(47,2,2,'*spåvne?\n','2014-05-05 17:20:43'),(48,1,2,'\nog Mye bedre respons, uten delay','2014-05-05 17:20:45'),(49,1,2,'\nhm, Norengelsk','2014-05-05 17:20:57'),(50,1,2,'\n\\&quot;spawn\\&quot; på engelsk','2014-05-05 17:21:09'),(51,2,2,'ok - hva betyr det?','2014-05-05 17:21:10'),(52,1,2,'\ndukke opp?','2014-05-05 17:21:14'),(53,2,2,'\nok - tak','2014-05-05 17:21:26'),(54,2,2,'\ntakk','2014-05-05 17:21:27'),(55,2,2,'\nda kjører vi på det','2014-05-05 17:21:31'),(56,1,2,'\nnår du får medling da skal komme opp ny knapp og blinke','2014-05-05 17:21:31'),(57,1,2,'\njeg skal rigge den opp inatt','2014-05-05 17:21:48'),(58,1,2,'\njeg har engen liten liste med det som skal tweakes','2014-05-05 17:22:31'),(59,1,2,'\nskal oppdatere test-dokk','2014-05-05 17:22:40'),(60,1,2,'\nf ks når man deler Youtube video, ','2014-05-05 17:22:51'),(61,2,2,'Vi bør ha en notification som er synlig på plattformen - mulig øverste linje. Denne bør varsle bruker om at har mottatt message/chat/likes osv.','2014-05-05 17:22:52'),(62,1,2,'\niFrame (embedded video) er ikke bred nok','2014-05-05 17:23:02'),(63,1,2,'jeg synes den neste vers av chatten er bra - du ser med en gang du fikk melding\n','2014-05-05 17:23:32'),(64,1,2,'\nvi kan teste den imorgen','2014-05-05 17:23:45'),(65,1,2,'også, tenker, trenger vi \\&quot;Forum\\&quot; ? utenom grupper?','2014-05-05 17:24:25'),(66,1,2,'jeg har bra komponnet som vi kan bare plugg inn','2014-05-05 17:24:38'),(67,1,2,'\nkomponent','2014-05-05 17:24:43'),(68,1,2,'\nhvis det blir ikek alltfor mye','2014-05-05 17:25:08'),(69,2,2,'litt vanskelig å følge/lese all info som blir lagt inn her pga lite plass. \n','2014-05-05 17:25:21'),(70,2,2,'\nkan vi swoppe til Skype?','2014-05-05 17:25:28'),(71,1,2,'\nja','2014-05-05 17:25:32'),(72,1,2,'yo','2014-05-06 18:03:30'),(73,1,2,'\nsender deg android prototypen snart','2014-05-06 18:03:40'),(74,2,2,'yo!','2014-05-06 18:04:34'),(75,2,2,'\nsweet!','2014-05-06 18:04:36'),(76,2,2,'I can only see åart of this screen on phone. Needs to be scaled','2014-05-07 05:54:32'),(77,1,2,'yo','2014-05-14 08:00:48'),(78,1,2,'\nonline?','2014-05-14 08:00:50'),(79,2,2,'ja...når ble melding skrevet forresten? vi må ha en timestamp på når meldinger blir skrevet :)','2014-05-14 12:18:19'),(80,1,2,'hm, god poeng','2014-05-20 02:56:28'),(81,1,4,'online?','2014-05-20 03:01:05'),(82,3,4,'w00t w00t','2014-05-20 16:26:46'),(83,1,4,';)','2014-05-21 06:07:16'),(84,1,2,'yo','2014-05-21 06:07:23'),(85,1,4,'der?','2014-05-21 09:45:22'),(86,1,4,'sendt epost','2014-05-21 09:45:31'),(87,1,4,'\nmå ta pause nå, vært oppe hele natten','2014-05-21 09:45:42'),(88,1,4,'\nMEN ','2014-05-21 09:45:46'),(89,1,4,'\nkjører små oppdateringder fremtil 16, ','2014-05-21 09:45:57'),(90,1,4,'\nSÅ laster opp ny PM module','2014-05-21 09:46:03'),(91,1,2,'gaijin: der?\ngaijin: sendt epost\ngaijin: må ta pause nå, vært oppe hele natten\ngaijin: MEN\ngaijin: kjører små oppdateringder fremtil 16,\ngaijin: SÅ laster opp ny PM module','2014-05-21 09:46:18'),(92,1,4,'fsfdsfs','2014-05-21 18:05:52'),(93,3,5,'josadf