INSERT INTO `wp_embedly_providers` VALUES (1,'youtube',1,'YouTube','youtube.com','video','http://cdn.embed.ly/providers/favicons/youtube.ico','[\"#http:\\/\\/.*youtube\\\\.com\\/watch.*#i\",\"#http:\\/\\/.*\\\\.youtube\\\\.com\\/v\\/.*#i\",\"#https:\\/\\/.*youtube\\\\.com\\/watch.*#i\",\"#https:\\/\\/.*\\\\.youtube\\\\.com\\/v\\/.*#i\",\"#http:\\/\\/youtu\\\\.be\\/.*#i\",\"#http:\\/\\/.*\\\\.youtube\\\\.com\\/user\\/.*#i\",\"#http:\\/\\/.*\\\\.youtube\\\\.com\\/.*\\\\#.*\\/.*#i\",\"#http:\\/\\/m\\\\.youtube\\\\.com\\/watch.*#i\",\"#http:\\/\\/m\\\\.youtube\\\\.com\\/index.*#i\",\"#http:\\/\\/.*\\\\.youtube\\\\.com\\/profile.*#i\",\"#http:\\/\\/.*\\\\.youtube\\\\.com\\/view_play_list.*#i\",\"#http:\\/\\/.*\\\\.youtube\\\\.com\\/playlist.*#i\",\"#http:\\/\\/www\\\\.youtube\\\\.com\\/embed\\/.*#i\",\"#https:\\/\\/www\\\\.youtube\\\\.com\\/embed\\/.*#i\"]','YouTube is the world\'s most popular online video community, allowing millions of people to discover, watch and share originally-created videos. YouTube provides a forum for people to connect, inform, and inspire others across the globe and acts as a distribution platform for original content creators and advertisers large and small.'),(2,'justintv',1,'Justin.tv','justin.tv','video','http://cdn.embed.ly/providers/favicons/justintv.ico','[\"#http:\\/\\/.*twitch\\\\.tv\\/.*#i\",\"#http:\\/\\/.*justin\\\\.tv\\/.*\\/b\\/.*#i\",\"#http:\\/\\/.*justin\\\\.tv\\/.*\\/w\\/.*#i\"]','Justin.tv is the largest online community for people to broadcast, watch and interact around live video.'),(3,'twitchtv',1,'Twitch.tv','twitch.tv','video','http://cdn.embed.ly/providers/favicons/twitchtv.ico','[\"#http:\\/\\/.*twitch\\\\.tv\\/.*#i\",\"#http:\\/\\/.*twitch\\\\.tv\\/.*\\/b\\/.*#i\"]','TwitchTV is the world\'s largest video game broadcasting and chat community.'),(4,'ustream',1,'UStream','ustream.com','video','http://cdn.embed.ly/providers/favicons/ustream.ico','[\"#http:\\/\\/www\\\\.ustream\\\\.tv\\/recorded\\/.*#i\",\"#http:\\/\\/www\\\\.ustream\\\\.tv\\/channel\\/.*#i\",\"#http:\\/\\/www\\\\.ustream\\\\.tv\\/.*#i\",\"#http:\\/\\/ustre\\\\.am\\/.*#i\"]','Ustream is an interactive platform that enables anyone with a camera and an Internet connection to quickly and easily broadcast to an online global audience. In less than two minutes, anyone can become a broadcaster by creating their own channel on Ustream or by broadcasting through their own site.'),(5,'qik',1,'Qik','qik.com','video','http://cdn.embed.ly/providers/favicons/qik.ico','[\"#http:\\/\\/qik\\\\.com\\/video\\/.*#i\",\"#http:\\/\\/qik\\\\.com\\/.*#i\",\"#http:\\/\\/qik\\\\.ly\\/.*#i\"]','Qik lets you share your everyday life experiences as it happens with your family and friends - right from your mobile phone.'),(6,'revision3',1,'Revision3','revision3.com','video','http://cdn.embed.ly/providers/favicons/revision3.ico','[\"#http:\\/\\/.*revision3\\\\.com\\/.*#i\"]','Revision3 is the leading television network for the internet generation. We create and produce all-original episodic community driven programs watched by a super-committed and passionate fan base. Our hyper-connected audience gets the vast majority of its entertainment, information and social connections through the internet.'),(7,'dailymotion',1,'Daily Motion','dailymotion.com','video','http://cdn.embed.ly/providers/favicons/dailymotion.ico','[\"#http:\\/\\/.*\\\\.dailymotion\\\\.com\\/video\\/.*#i\",\"#http:\\/\\/.*\\\\.dailymotion\\\\.com\\/.*\\/video\\/.*#i\"]','Dailymotion is about finding new ways to see, share and engage your world through the power of online video. You can find - or upload - videos about your interests and hobbies, eyewitness accounts of recent news and distant places, and everything else from the strange to the spectacular.'),(8,'collegehumor',1,'College Humor','collegehumor.com','video','http://cdn.embed.ly/providers/favicons/collegehumor.ico','[\"#http:\\/\\/collegehumor\\\\.com\\/video:.*#i\",\"#http:\\/\\/collegehumor\\\\.com\\/video\\/.*#i\",\"#http:\\/\\/www\\\\.collegehumor\\\\.com\\/video:.*#i\",\"#http:\\/\\/www\\\\.collegehumor\\\\.com\\/video\\/.*#i\"]','CollegeHumor is the #1 comedy site on the internet. We showcase hilarious original videos, articles, contests, and interactive features, as well as pictures and videos submitted by fans like you. Our in-house writing and production team powers CH Originals, which delivers original, TV-quality comedy videos multiple times a week.'),(9,'telly',1,'Telly','telly.com','video','http://cdn.embed.ly/providers/favicons/telly.ico','[\"#http:\\/\\/telly\\\\.com\\/.*#i\",\"#http:\\/\\/www\\\\.telly\\\\.com\\/.*#i\"]','Telly is a fun & simple way to collect and share cool videos you find.'),(10,'break',1,'Break.com','break.com','video','http://cdn.embed.ly/providers/favicons/break.ico','[\"#http:\\/\\/break\\\\.com\\/.*\\/.*#i\",\"#http:\\/\\/www\\\\.break\\\\.com\\/.*\\/.*#i\"]','Watch funny videos and video clips at Break.com. Our editors find the best funny videos, clips and pictures for you to watch right now.'),(11,'myspacevideos',1,'Myspace Videos','vids.myspace.com','video','http://cdn.embed.ly/providers/favicons/myspacevideos.ico','[\"#http:\\/\\/vids\\\\.myspace\\\\.com\\/index\\\\.cfm\\\\?fuseaction=vids\\\\.individual&videoid.*#i\",\"#http:\\/\\/www\\\\.myspace\\\\.com\\/index\\\\.cfm\\\\?fuseaction=.*&videoid.*#i\"]','MySpace is a technology company connecting people through personal expression, content, and culture. MySpace empowers its global community to experience the Internet through a social lens by integrating personal profiles, photos, videos, mobile, messaging, games, and the world\'s largest music community.'),(12,'metacafe',1,'MetaCafe','metacafe.com','video','http://cdn.embed.ly/providers/favicons/metacafe.ico','[\"#http:\\/\\/www\\\\.metacafe\\\\.com\\/watch\\/.*#i\",\"#http:\\/\\/www\\\\.metacafe\\\\.com\\/w\\/.*#i\"]','Metacafe is a social video site that algorithmically filters what appears on the site. Users and content producers are allowed to submit any videos they want but Metacafe uses its filtering algorithm VideoRank to choose the \"most entertaining\" and \"high quality\" videos.'),(13,'bliptv',1,'Blip.tv','blip.tv','video','http://cdn.embed.ly/providers/favicons/bliptv.ico','[\"#http:\\/\\/blip\\\\.tv\\/.*\\/.*#i\",\"#http:\\/\\/.*\\\\.blip\\\\.tv\\/.*\\/.*#i\"]','More than 48,000 independently produced Web shows use blip.tv to reach more than 22,000,000 people. We distribute more than 2.4 million episodes from these shows across the entire video Internet and onto television screens across the country.'),(14,'googlevideo',1,'Google Videos','video.google.com','video','http://cdn.embed.ly/providers/favicons/googlevideo.ico','[\"#http:\\/\\/video\\\\.google\\\\.com\\/videoplay\\\\?.*#i\"]','Google Videos is a free video sharing website and also a video search engine from Google Inc. Google Videos allows selected videos to be remotely embedded on other websites and provides the necessary HTML code alongside the media, similar to YouTube.'),(15,'yahoovideo',1,'Yahoo! Video','video.yahoo.com','video','http://cdn.embed.ly/providers/favicons/yahoovideo.ico','[\"#http:\\/\\/video\\\\.yahoo\\\\.com\\/watch\\/.*\\/.*#i\",\"#http:\\/\\/video\\\\.yahoo\\\\.com\\/network\\/.*#i\",\"#http:\\/\\/sports\\\\.yahoo\\\\.com\\/video\\/.*#i\"]','Yahoo! Video is the best place to view and upload video on the Web. It\'s the perfect pop-culture mashup, the best of the best-all video from across the Yahoo! network in one place. Of course we have unicorns, chipmunks, ninjas, cats, and robots. We also have music videos and news, sports, autos, comedy, TV clips, and movie previews.'),(16,'viddler',1,'Viddler','viddler.com','video','http://cdn.embed.ly/providers/favicons/viddler.ico','[\"#http:\\/\\/.*viddler\\\\.com\\/v\\/.*#i\"]','A fresh, creative web application that allows you to upload, enhance, and share digital video easily and quickly inside your web browser.'),(17,'liveleak',1,'LiveLeak','www.liveleak.c