der=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/35625/\" /></a> <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=35625&subd=wptv&ref=&feed=1\" width=\"1\" height=\"1\" /><div><a href=\"http://wordpress.tv/2014/06/23/rona-kilmer-theme-sassification/\"><img alt=\"Rona Kilmer: Theme SASSification\" src=\"http://videos.videopress.com/g8V8IzoY/video-a1649c7bb6_scruberthumbnail_1.jpg\" width=\"160\" height=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 23 Jun 2014 18:00:18 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"WordPress.tv\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"WPTavern: WordPress JSON REST API Version 1.1 Released with New Authentication Documentation\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=25160\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:228:\"http://wptavern.com/wordpress-json-rest-api-version-1-1-released-with-new-authentication-documentation?utm_source=rss&utm_medium=rss&utm_campaign=wordpress-json-rest-api-version-1-1-released-with-new-authentication-documentation\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3242:\"<p>Over the weekend, Ryan McCue and collaborators released version 1.1 of the <a href=\"http://wordpress.org/plugins/json-rest-api/\" target=\"_blank\">JSON REST API</a> plugin. The WP API team is aiming to have it <a href=\"http://wptavern.com/json-rest-api-slated-for-wordpress-4-1-release\" target=\"_blank\">ready for inclusion in WordPress 4.1</a>, which will drop later this year.</p>\n<p>This release focused heavily on testing, fixing bugs discovered through tests, and improving the API documentation. New routes have been added for taxonomies and terms. Excerpts and password-protected post handling have also been improved. Revision endpoint tests are new in 1.1. Coverage for post endpoint testing is now at more than 54% for the whole class and more than 80% for the main methods. McCue says this figure will continue to rise over the next few releases. You can <a href=\"https://github.com/WP-API/WP-API/compare/1.0...1.1\" target=\"_blank\">view all the changes and bug fixes</a> for this release on GitHub.</p>\n<p>The WP API team often receives questions regarding how to handle authentication. Version 1.1 includes full <a href=\"https://github.com/WP-API/WP-API/blob/master/docs/authentication.md\" target=\"_blank\">documentation on authentication methods</a>, including cookie authentication (for plugins/themes running on a site) and OAuth (for desktop/web/mobile clients accessing a site externally). A basic authentication method is also included in the docs and is useful for development purposes only.</p>\n<p>I&#8217;ve been working with the WP API team to help get documentation organized and presented in a way that&#8217;s easy to read and navigate. We&#8217;re in the process of merging all the docs into one centralized hub at <a href=\"http://wp-api.org/\" target=\"_blank\">wp-api.org</a>, which pulls from the various docs in the <a href=\"https://github.com/WP-API\" target=\"_blank\">WP API</a> GitHub repos. We&#8217;re working to make this a top-notch resource for any developer who wants to build with the new API.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/06/wp-api-docs.png\" rel=\"prettyphoto[25160]\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/06/wp-api-docs.png?resize=1025%2C472\" alt=\"WordPress API Documentation\" class=\"aligncenter size-full wp-image-25193\" /></a></p>\n<p>Work for <a href=\"https://github.com/WP-API/WP-API/issues?milestone=7&state=open\" target=\"_blank\">version 1.2</a> is already underway. &#8220;With version 1.2 and onwards, we’ll be tackling a bunch of <a href=\"https://github.com/WP-API/WP-API/issues?labels=Testing\" target=\"_blank\">extra testing for our endpoints</a>, with the aim of eventually reaching >90% coverage,&#8221; McCue noted in the <a href=\"http://make.wordpress.org/core/2014/06/23/json-rest-api-version-1-1/\" target=\"_blank\">release announcement</a>. If you&#8217;d like to join in collaboration on <a href=\"https://github.com/WP-API/WP-API/blob/master/CONTRIBUTING.md\" target=\"_blank\">GitHub</a>, the team is always looking for help.</p>\n<p>Are any of our readers already building something with the new JSON REST API? Let us know in the comments. Is there anything specific that you&#8217;d like to see added to the documentation?</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 23 Jun 2014 16:40:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"Matt: Apply to Speak at WordCamp SF\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=43842\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://ma.tt/2014/06/apply-to-speak-at-wordcamp-sf/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:310:\"<p>The big daddy of WordCamps is open about another week for speaker submissions, if you have something interesting you&#8217;d like to say to the WordPress world <a href=\"http://2014.sf.wordcamp.org/2014/06/16/speaking-at-wordcamp-san-francisco/\">send in your application to speak at WordCamp SF here</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 23 Jun 2014 15:53:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"WPTavern: Dates Announced For PressNomics 3 – Jan 22nd-24th, 2015\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=25176\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:168:\"http://wptavern.com/dates-announced-for-pressnomics-3-jan-22nd-24th-2015?utm_source=rss&utm_medium=rss&utm_campaign=dates-announced-for-pressnomics-3-jan-22nd-24th-2015\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2889:\"<p>Dates have been announced for the third annual <a title=\"http://pressnomics.com/\" href=\"http://pressnomics.com/\">PressNomics conference</a>. Organized by Joshua and Sally Strebel of <a title=\"http://pagely.com/\" href=\"http://pagely.com/\">Pagely</a>, PressNomics is a conference similar to a WordCamp but focuses exclusively on the business of WordPress and the economy surrounding it.</p>\n<p>The conference will take place J<strong>anuary 22nd &#8211; 24th, </strong>2015 in Tempe, AZ. The venue is the same as last year, the <a title=\"http://www.missionpalms.com/\" href=\"http://www.missionpalms.com/\">Tempe Mission Palms Hotel</a>. There is a discounted rate of <a title=\"https://gc.synxis.com/rez.aspx?Hotel=12318&Chain=5156&arrive=1/21/2015&depart=1/25/2015&adult=1&child=0&group=2U25J7\" href=\"https://gc.synxis.com/rez.aspx?Hotel=12318&Chain=5156&arrive=1/21/2015&depart=1/25/2015&adult=1&child=0&group=2U25J7\">$194 per night</a> available on a first come, first serve basis. PressNomics sells out fast but while you can book your hotel room now, tickets don&#8217;t go on sale until <strong>August 6th at 10AM Pacific</strong>.</p>\n<div id=\"attachment_25180\" class=\"wp-caption aligncenter\"><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/PressNomics2FeaturedImage.png\" rel=\"prettyphoto[25176]\"><img class=\"size-full wp-image-25180\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/PressNomics2FeaturedImage.png?resize=740%2C300\" alt=\"PressNomics 2 Featured Image\" /></a><p class=\"wp-caption-text\">PressNomics 2 Courtesy Of <a title=\"http://mattreport.com/pressnomics-review/\" href=\"http://mattreport.com/pressnomics-review/\">Mattreport.com</a></p></div>\n<p>PressNomics is a three-day event to relax, collaborate, and discuss the economics surrounding WordPress.  Notable speakers in the past include Mark Jaquith, Cory Miller, and Mikkel Svane. <a title=\"http://chrislema.com/pressnomics-good-bad-awesome/\" href=\"http://chrislema.com/pressnomics-good-bad-awesome/\">Chris Lema</a> and <a title=\"http://mattreport.com/pressnomics-review/\" href=\"http://mattreport.com/pressnomics-review/\">Matt Mederios</a> both have great reviews of the event when they attended in 2013. It&#8217;s quickly become one of the premiere events outside of WordCamps.</p>\n<p>PressNomics is something I&#8217;ve been wanting to attend since its creation. I was never able to attend due to finances and timing. However, I&#8217;m happy to say that I&#8217;ll be in attendance for version 3 of the event and will be covering it for the Tavern.</p>\n<p>I&#8217;m really looking forward to surrounding myself with the movers and shakers of the WordPress business world. I want to know what everyone is thinking and get a feel for what direction WordPress is heading. Let me know in the comments if you plan on going to PressNomics 3. I&#8217;d love to meet and talk to you.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 23 Jun 2014 04:53:29 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"WPTavern: What Naming Convention Do You Use For WordPress Media?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=25166\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:170:\"http://wptavern.com/what-naming-convention-do-you-use-for-wordpress-media?utm_source=rss&utm_medium=rss&utm_campaign=what-naming-convention-do-you-use-for-wordpress-media\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2695:\"<p>After <strong>six years</strong> of serving cold beverages at the Tavern and publishing more than <strong>2,100 posts</strong>, our media library has over <strong>2,770 images</strong>. Over the years, the meta information I give images has changed from very little to as descriptive as possible. For example, we use a theme that utilizes featured images. When I upload a featured image, I&#8217;ll give it a title that&#8217;s descriptive to the post it will be attached to.</p>\n<p>In this example, the title of the image is <em>Market Share Pie Featured Image</em> since the post it would be attached to talks about the market share of GravityForms and would be the featured image for the post. For the Alt Text, I described the image as,<em> GravityForms Market Share Pie Featured Image</em>. The ALT text is usually just the image title with spaces in between.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/06/HowILabelFeaturedImages.png\" rel=\"prettyphoto[25166]\"><img class=\"aligncenter size-full wp-image-25167\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/06/HowILabelFeaturedImages.png?resize=553%2C620\" alt=\"HowILabelFeaturedImages\" /></a></p>\n<p>When I need to reuse a featured image, all I have to do is search for <strong>Featured Image</strong> in the media library. The search results are made up of all of the previous featured images I&#8217;ve uploaded. Since we don&#8217;t have too many to wade through, finding the one I want doesn&#8217;t take long.</p>\n<h3>Empowered To Improve Media Library Search Results</h3>\n<p>The WordPress media library is an archive of content. The larger it gets, the more difficult it can be to find things. Personally, I think being as descriptive as possible with each field with the exception of the caption is the easiest way to improve the media library search engine results. If I fail to be descriptive with images and provide ample meta information, then whose fault is it when the media library can&#8217;t find what I&#8217;m looking for?</p>\n<p>This is one of those areas of WordPress where I believe users are empowered. They have the choice of either providing as much or as little information as possible. I think the less information provided over time could prove to be detrimental to the media library search functionality. I&#8217;d love to hear from those with experience in this area, especially from site owners who have thousands of items within their media library.</p>\n<p><strong>What naming convention you use to manage your WordPress media library?</strong> Do you use any plugins to aid in media management? I don&#8217;t think my convention is the best, but it works for me.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 23 Jun 2014 03:46:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:88:\"WPTavern: WPWeekly Episode 152 – Electrifying Interview With Nikhil Vimal Of TechVoltz\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://wptavern.com?p=25068&preview_id=25068\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:212:\"http://wptavern.com/wpweekly-episode-152-electrifying-interview-with-nikhil-vimal-of-techvoltz?utm_source=rss&utm_medium=rss&utm_campaign=wpweekly-episode-152-electrifying-interview-with-nikhil-vimal-of-techvoltz\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2732:\"<p>At age 15, Nikhil Vimal is the youngest guest to ever be interviewed on WordPress Weekly. Based out of Minnesota, Vimal has <a href=\"http://profiles.wordpress.org/nikv\" title=\"http://profiles.wordpress.org/nikv\">quickly made his mark</a> in the WordPress community. He&#8217;s already spoken at his first WordCamp and contributed to the core of WordPress through the inline documentation project. He&#8217;s also been confirmed to speak at <a href=\"http://2014.milwaukee.wordcamp.org/\" title=\"http://2014.milwaukee.wordcamp.org/\">WordCamp Milwaukee 2014</a>.</p>\n<p>In this interview, we get a unique perspective on what it&#8217;s like to contribute to WordPress at such a young age. We also learn about some of the projects he&#8217;s working on with <a title=\"http://techvoltz.com/\" href=\"http://techvoltz.com/\">TechVoltz.com</a>. This young man has a good head on his shoulders and is in line to be part of the next generation of WordPress developers.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"http://wptavern.com/wordpress-trunk-adds-new-beta-testing-tab-to-plugins-screen\" title=\"http://wptavern.com/wordpress-trunk-adds-new-beta-testing-tab-to-plugins-screen\">WordPress Trunk Adds New Beta Testing Tab to Plugins Screen</a><br />\n<a href=\"http://wptavern.com/versionpress-adopts-the-gpl-software-license\" title=\"http://wptavern.com/versionpress-adopts-the-gpl-software-license\">VersionPress Adopts The GPL Software License</a><br />\n<a href=\"http://wptavern.com/preview-the-wordpress-menu-customizer-alpha-plugin-ready-for-testing\" title=\"http://wptavern.com/preview-the-wordpress-menu-customizer-alpha-plugin-ready-for-testing\">Preview the WordPress Menu Customizer: Alpha Plugin Ready for Testing</a><br />\n<a href=\"http://wptavern.com/wordpress-themes-suck-at-accessibility-its-time-to-fix-it\" title=\"http://wptavern.com/wordpress-themes-suck-at-accessibility-its-time-to-fix-it\">WordPress Themes Suck at Accessibility: It’s Time to Fix It</a></p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Friday, June 27th 3 P.M. Eastern &#8211; Peter Bui of the <a title=\"http://joomlabe.at/\" href=\"http://joomlabe.at/\">Joomla Beat</a> podcast</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"http://www.wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #152:</strong><br />\n</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 23 Jun 2014 02:30:27 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"WordPress.tv: WordPress Security Show: Is Your Site Really Secure? (2/2)\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wordpress.tv/?p=35771\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"http://wordpress.tv/2014/06/22/wordpress-security-show-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:670:\"<div id=\"v-E2swTpRH-1\" class=\"video-player\">\n</div><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/35771/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/35771/\" /></a> <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=35771&subd=wptv&ref=&feed=1\" width=\"1\" height=\"1\" /><div><a href=\"http://wordpress.tv/2014/06/22/wordpress-security-show-2/\"><img alt