"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=35765&subd=wptv&ref=&feed=1\" width=\"1\" height=\"1\" /><div><a href=\"http://wordpress.tv/2014/06/22/konstantin-obenland-contributing-to-wordpress/\"><img alt=\"「WordPress への貢献（Contributing to WordPress）」 WordCamp Tokyo 2013\" src=\"http://videos.videopress.com/Nhs9DKsx/e3808cwordpress-e381b8e381aee8b2a2e78caeefbc88contributing-to-wordpressefbc89e3808d-wordcamp-tokyo-2013_std.original.jpg\" width=\"160\" height=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 22 Jun 2014 18:15:08 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"WordPress.tv\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:12;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"WPTavern: How to Create Demo Data for a BuddyPress Site\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=25131\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:154:\"http://wptavern.com/how-to-create-demo-data-for-a-buddypress-site?utm_source=rss&utm_medium=rss&utm_campaign=how-to-create-demo-data-for-a-buddypress-site\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3156:\"<p>When testing BuddyPress themes and plugins, it&#8217;s helpful to have some data to populate the network and demo its social components. Manually adding users with avatars, activity updates, messages, etc,  can be a tedious process. Fortunately, there&#8217;s a way to automate the creation of demo data.</p>\n<p>The <a href=\"http://wordpress.org/plugins/bp-default-data/\" target=\"_blank\">BuddyPress Default Data</a> plugin instantly creates a bunch of users, messages, friend connections, groups, topics, and activity items for testing purposes. Users are created with avatars generated by <a href=\"http://8biticon.com/\" target=\"_blank\">8biticon.com</a>. After installing the plugin, you&#8217;ll have the option to select what kind of demo data you want to create:</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/buddypress-default-data.png\" rel=\"prettyphoto[25131]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/buddypress-default-data.png?resize=1025%2C565\" alt=\"buddypress-default-data\" class=\"aligncenter size-full wp-image-25139\" /></a></p>\n<p>After you make your selections and import the data, you&#8217;ll see a success message detailing all the new data created:</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/success.png\" rel=\"prettyphoto[25131]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/success.png?resize=690%2C364\" alt=\"success\" class=\"aligncenter size-full wp-image-25141\" /></a></p>\n<p>Check your site and you&#8217;ll find all the new members, activity, groups, etc. Activity items will all have the same timestamp, as they were created at the same time.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/activity.png\" rel=\"prettyphoto[25131]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/activity.png?resize=800%2C387\" alt=\"activity\" class=\"aligncenter size-full wp-image-25147\" /></a></p>\n<p>Before using the plugin, you&#8217;ll want to make sure to turn off email notifications for the admin user or else you&#8217;ll blow up your inbox with a ton of emails generated by the data as it&#8217;s created.</p>\n<p>The plugin also has the ability to automatically clean out all the test data when you&#8217;re finished. Using the &#8220;Clear BuddyPress Data&#8221; button will truncate the tables for messages, groups, notifications, friends and forum posts. Be advised that it will delete all users except for the one with ID=1 and all the corresponding data, i.e. usermeta, activity, etc. This plugin should be used with caution and only on a test site.</p>\n<p>Hopefully the <a href=\"http://wordpress.org/plugins/bp-default-data/\" target=\"_blank\">BuddyPress Default Data</a> plugin will save you a little time when testing BuddyPress and its extensions. You can download it from WordPress.org. If WP-CLI is part of your workflow, then you might opt for using Boone Gorges&#8217; <a href=\"http://wptavern.com/a-library-of-wp-cli-commands-for-buddypress\" target=\"_blank\">WP-CLI community package of BuddyPress commands</a>. It allows you to quickly create demo data using the command line.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 22 Jun 2014 02:15:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:13;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"WordPress.tv: 