tegory.jpg\" rel=\"prettyphoto[25103]\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/06/tweetbycategory.jpg?resize=772%2C250\" alt=\"tweetbycategory\" class=\"aligncenter size-full wp-image-25114\" /></a></p>\n<p>Last month, Twitter rolled out its new <a href=\"https://blog.twitter.com/2014/another-way-to-edit-your-twitter-experience-with-mute\" target=\"_blank\">mute button feature</a> which allows users to filter out unwanted tweets. This makes it easy for your followers to turn you off entirely if they feel that you&#8217;re overloading them with tweets. Users won&#8217;t always opt to unfollow you, so you&#8217;ll never know who has pushed the mute button and is no longer listening. That&#8217;s why it&#8217;s important not to flood your followers with a constant stream of information that may not be relevant to your core audience.</p>\n<p>In light of the new ease of muting on Twitter, some WordPress publishers may want to consider scaling back the tweets that are automatically sent out when posts are published. <a href=\"https://wordpress.org/plugins/publish-to-twitter/\" target=\"_blank\">Publish to Twitter </a>is a free plugin from the folks at <a href=\"http://10up.com/\" target=\"_blank\">10up</a>. It essentially allows you to tweet by category, instead of publishing all of your posts to Twitter.</p>\n<p>Additionally, the plugin allows you to authorize multiple Twitter accounts and associate categories with each one. This can help you target your content to send to the right group of followers.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/settings.png\" rel=\"prettyphoto[25103]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/settings.png?resize=1025%2C618\" alt=\"settings\" class=\"aligncenter size-full wp-image-25110\" /></a></p>\n<p>In order to use the plugin, you&#8217;ll need to <a href=\"https://apps.twitter.com/apps\" target=\"_blank\">create a new Twitter application</a>, which is an easy/guided process. Next, copy the Consumer and Consumer Secret keys from your new application and paste them into the plugin&#8217;s settings page. You can then successfully associate categories to your authenticated Twitter accounts.</p>\n<p>If you&#8217;re constantly publishing content and automatically sending it to Twitter, this handy plugin may save you from getting muted. Download <a href=\"http://wordpress.org/plugins/publish-to-twitter/\" target=\"_blank\">Publish to Twitter</a> for free from WordPress.org.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 20 Jun 2014 18:08:46 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:20;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"WPTavern: Quick Reference Guide For Those Writing About WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=24430\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:174:\"http://wptavern.com/quick-reference-guide-for-those-writing-about-wordpress?utm_source=rss&utm_medium=rss&utm_campaign=quick-reference-guide-for-those-writing-about-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4512:\"<p>After participating in the WordPress community for several years, it&#8217;s easy to forget there are new users entering the community every day. As someone who writes about WordPress for a living, it&#8217;s frustrating to come across errors such as the incorrect spelling of WordPress or the incorrect logo being used. However, I&#8217;ve discovered that most of the time, they just don&#8217;t know any better. Even established websites make simple mistakes such as labeling Automattic as the parent company of WordPress.</p>\n<p>The following cheat sheet for newcomers and veterans of WordPress quickly addresses some of the most common mistakes often made when writing about WordPress. It also has general information about the project for quick reference.</p>\n<ol>\n<li>WordPress is camel cased meaning the P is capitalized. It&#8217;s spelled WordPress.</li>\n<li>WordPress is a <a title=\"http://wordpressfoundation.org/trademark-policy/\" href=\"http://wordpressfoundation.org/trademark-policy/\">registered trademark</a>. As such, you&#8217;re not allowed to have WordPress in the domain name without explicit permission.</li>\n<li>Here is the <a title=\"http://wordpress.org/about/logos/\" href=\"http://wordpress.org/about/logos/\">correct WordPress logo</a> to use. Notice the short and squat versus the tall and eloquent.</li>\n<li><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2009/02/correct-wordpress-logos.png\" rel=\"prettyphoto[24430]\"><img class=\"aligncenter size-full wp-image-408\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2009/02/correct-wordpress-logos.png?resize=743%2C452\" alt=\"correct-wordpress-logos\" /></a></li>\n<li>WordPress the open source project is free (free as in speech) and licensed under the <a title=\"http://wordpress.org/about/license/\" href=\"http://wordpress.org/about/license/\">GPLv2</a></li>\n<li>Automattic does not own WordPress and is not the parent company of WordPress. It&#8217;s the parent company of <a href=\"http://www.wordpress.com\">WordPress.com</a>.</li>\n<li><a title=\"http://www.wordpress.org\" href=\"http://www.wordpress.org\">WordPress.org</a> is a free open source project anyone can use. WordPress.com is a hosted platform. A good analogy is to think of WordPress the open source project as a house that you can manipulate any way you want. WordPress.com is like an apartment complex. <a title=\"http://en.support.wordpress.com/com-vs-org/\" href=\"http://en.support.wordpress.com/com-vs-org/\">This guide</a> explains the major differences between the two.</li>\n<li>Matt Mullenweg and Mike Little are the creators of WordPress. For historical purposes, <a title=\"http://ma.tt/2003/01/the-blogging-software-dilemma/\" href=\"http://ma.tt/2003/01/the-blogging-software-dilemma/\">read this post and the first comment</a> which is considered the birth of WordPress.</li>\n<li>WordPress the open source project <a title=\"http://wordpress.org/about/\" href=\"http://wordpress.org/about/\">was started in 2003</a> and is over 10 years old.</li>\n<li>Matt Mullenweg is the CEO of <a title=\"http://automattic.com/\" href=\"http://automattic.com/\">Automattic</a>, the founder of the non-profit <a title=\"http://wordpressfoundation.org/\" href=\"http://wordpressfoundation.org/\">WordPress Foundation</a>, occasional lead developer for the open source WordPress Project, and owner of investment company <a title=\"http://audrey.co/\" href=\"http://audrey.co/\">Audrey.co</a>.</li>\n<li>The <a title=\"http://wordpress.org/support/\" href=\"http://wordpress.org/support/\">WordPress.org support forum</a> is staffed by non-paid volunteers.</li>\n<li>The recommended place to download <a title=\"http://wordpress.org/themes/\" href=\"http://wordpress.org/themes/\">WordPress themes</a> and <a title=\"http://wordpress.org/plugins/\" href=\"http://wordpress.org/plugins/\">plugins</a> is from their respective directories. Every theme and plugin hosted on WordPress.org is free of charge.</li>\n<li>13. It’s Automattic with two t&#8217;s. via <a title=\"http://wptavern.com/quick-reference-guide-for-those-writing-about-wordpress#comment-56126\" href=\"http://wptavern.com/quick-reference-guide-for-those-writing-about-wordpress#comment-56126\">Michael Quinn</a></li>\n</ol>\n<p>This is by no means an exhaustive list. If you have any tips or suggestions, please add them in the comments. I&#8217;ll keep the post updated so it can be a relevant, living guide. By the way, if you read an article about WordPress that contains a mistake, respectfully point the author in the right direction.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 20 Jun 2014 18:01:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:21;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:108:\"WordPress.tv: Tony Archambeau : Accessibilité &amp; WordPress : créer des sites pour tous les utilisateurs\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wordpress.tv/?p=36016\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:114:\"http://wordpress.tv/2014/06/20/tony-archambeau-accessibilite-wordpress-creer-des-sites-pour-tous-les-utilisateurs/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:707:\"<div id=\"v-32bCd27X-1\" class=\"video-player\">\n</div><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/36016/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/36016/\" /></a> <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=36016&subd=wptv&ref=&feed=1\" width=\"1\" height=\"1\" /><div><a href=\"http://wordpress.tv/2014/06/20/tony-archambeau-accessibilite-wordpress-creer-des-sites-pour-tous-les-utilisateurs/\"><img alt=\"15 &#8211; Tony Archambeau-Conf-WCParis2014.mp4\" src=\"http://videos.videopress.com/32bCd27X/video-53502ee6a0_std.original.jpg\" width=\"160\" height=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 20 Jun 2014 10:20:29 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"WordPress.tv\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:22;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"WPTavern: CLI Cheat Sheet: A Beginner’s Resource for Using the Command Line\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=25005\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:190:\"http://wptavern.com/cli-cheat-sheet-a-beginners-resource-for-using-the-command-line?utm_source=rss&utm_medium=rss&utm_campaign=cli-cheat-sheet-a-beginners-resource-for-using-the-command-line\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1887:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/cheatsheet.png\" rel=\"prettyphoto[25005]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/cheatsheet.png?resize=900%2C429\" alt=\"cheatsheet\" class=\"aligncenter size-full wp-image-25078\" /></a></p>\n<p><a href=\"https://github.com/WebDevStudios/CLI-Cheat-Sheet\" target=\"_blank\">CLI Cheat Sheet</a> is a handy new resource for any WordPress developer who is just getting started with the command line. This week on the <a href=\"http://dradcast.com/\" target=\"_blank\">Dradcast</a>, Brad Williams linked to the cheat sheet, which the folks at <a href=\"http://webdevstudios.com/\" target=\"_blank\">WebDevStudios</a> put together for their team. They decided to share the resource with the community.</p>\n<p>The repository is broken down into several files, separated by command type, including:</p>\n<ul>\n<li>General Command Line (CLI) basics</li>\n<li>Git Commands</li>\n<li>Grunt Commands</li>\n<li>Server Commands</li>\n<li>Moderate/Advanced Commands</li>\n</ul>\n<p>The basic commands document covers the very basics, such as changing directories and opening files. A section for more moderate/advanced commands is prefaced with a friendly notation: &#8220;The somewhat scary crevices of the command line.&#8221;</p>\n<p>The team at WebDevStudios plans to continue building out the cheat sheet and will be adding more commands into the repo as they are using them and remember them. If you want to share a few commands that every beginner ought to know, feel free to contribute on GitHub.</p>\n<p>Make sure to star the <a href=\"https://github.com/WebDevStudios/CLI-Cheat-Sheet\" target=\"_blank\">CLI Cheat Sheet</a> repo for easy reference and check back periodically for more commands. If you&#8217;re just starting with the command line, this is a nice resource to help you grasp the basics and get your footing.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 20 Jun 2014 03:06:29 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:23;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:100:\"WPTavern: GravityForms Detected On 53% Of The Top 1 Million Sites Ranked By Alexa Using Hosted Forms\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=25017\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:204:\"http://wptavern.com/gravityforms-detected-on-53-of-the-top-1-million-sites-ranked-by-alexa?utm_source=rss&utm_medium=rss&utm_campaign=gravityforms-detected-on-53-of-the-top-1-million-sites-ranked-by-alexa\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2702:\"<p><a title=\"http://www.datanyze.com\" href=\"http://www.datanyze.com\">Datanyze</a>, a company specializing in determining what web technologies are being used based on their code signature, <a title=\"http://www.datanyze.com/market-share/forms/\" href=\"http://www.datanyze.com/market-share/forms/\">has new data</a> indicating GravityForms has the most market share. Out of the top one million websites ranked by Alexa <strong>that use hosted forms</strong>, GravityForms was detected on 53.3% of them. That&#8217;s more than all of the other form plugins and services in the chart combined.</p>\n<div id=\"attachment_25053\" class=\"wp-caption aligncenter\"><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/GFormsDatanyzeChart.png\" rel=\"prettyphoto[25017]\"><img class=\"size-full wp-image-25053\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/GFormsDatanyzeChart.png?resize=636%2C503\" alt=\"GravityForms Leading The Way With 53.3%\" /></a><p class=\"wp-caption-text\">GravityForms Leading The Way With 53.3%</p></div>\n<p>I&#8217;m surprised Ninja Forms or Contact Form 7 is not on the pie chart. I thought Contact Form 7 would be their biggest competitor but it turns out it&#8217;s Wufoo and other form generating services. I contacted Datanyze to figure out if those systems are tracked or not.</p>\n<p>Jon Hearty of Datanyze said, &#8220;The reason they aren&#8217;t there is because we do not currently track them. We add technologies everyday, usually based on requests from our customers and prospects.&#8221;</p>\n<p>Datanyze explains on their <a title=\"http://www.datanyze.com/faq/#market-share\" href=\"http://www.datanyze.com/faq/#market-share\">frequently asked questions</a> page how they obtain the data and determine code signatures.</p>\n<blockquote><p>Most web technologies have certain footprints or &#8220;signatures&#8221; when used by one of the websites. For example, if you view the HTML code for any WordPress site, you will find something like this: <i>&lt;meta name=&#8221;generator&#8221; content=&#8221;WordPress &#8230;&#8221; /&gt;</i>. By finding and cataloging these signatures, Datanyze can determine not only which technologies a website is using, but also when they added or dropped them.</p></blockquote>\n<p>With the top one million websites ranked by Alexa changing each month, the data represented in the pie chart is only a snapshot of time. But what the data shows is that GravityForms is doing exceptionally well, especially against the other form solutions being monitored.</p>\n<p>I&#8217;d love to see more WordPress specific contact form solutions added to the chart such as Contact Form 7 and Ninja forms just to get a more complete picture.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 19 Jun 2014 21:40:18 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:24;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"WPTavern: Make Forms More User-Friendly With the Chosen jQuery Plugin for WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=25021\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:210:\"http://wptavern.com/make-forms-more-user-friendly-with-the-chosen-jquery-plugin-for-wordpress?utm_source=rss&utm_medium=rss&utm_campaign=make-forms-more-user-friendly-with-the-chosen-jquery-plugin-for-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4747:\"<div id=\"attachment_25058\" class=\"wp-caption aligncenter\"><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/06/long-list.jpg\" rel=\"prettyphoto[25021]\"><img class=\"size-full wp-image-25058\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/06/long-list.jpg?resize=1025%2C477\" alt=\"photo credit: Orí - cc\" /></a><p class=\"wp-caption-text\">photo credit: <a href=\"http://www.flickr.com/photos/ori/2467863551/\">Orí</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-nc-sa/2.0/\">cc</a></p></div>\n<p>Select boxes with a long list of options can quickly get out of hand. One common example is a state or country dropdown. Perhaps you&#8217;ve become desensitized to the expert scrolling and mousework required to navigate the most cumbersome select boxes. Ordinarily, they&#8217;re anything but user-friendly.</p>\n<p><a href=\"http://harvesthq.github.io/chosen/\" target=\"_blank\">Chosen</a> is a handy jQuery plugin created by the folks at <a href=\"http://www.getharvest.com/\" target=\"_blank\">Harvest</a> with the purpose of making select boxes more customizable and easier to use. The project is well maintained and has received contributions from more than 70 contributors on GitHub. You can view a <a href=\"http://harvesthq.github.io/chosen/\" target=\"_blank\">live example</a> of Chosen on its project demo page with side by side comparisons to browser default select boxes.</p>\n<p>With Chosen in place, simple select boxes get a larger, more sleek display with an auto-suggest-enabled search box at the top:</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/simple-select.png\" rel=\"prettyphoto[25021]\"><img class=\"aligncenter size-full wp-image-25035\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/simple-select.png?resize=362%2C267\" alt=\"simple-select\" /></a></p>\n<p>Multiple select boxes are notoriously difficult to use for making multiple selections. Chosen allows you to type in your selections and easily view / remove selections.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/06/multiple-select.png\" rel=\"prettyphoto[25021]\"><img class=\"aligncenter size-full wp-image-25037\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/06/multiple-select.png?resize=370%2C170\" alt=\"multiple-select\" /></a></p>\n<p>It also has optgroup support for multiple select boxes with groups:</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/multiple-select-with-groups.png\" rel=\"prettyphoto[25021]\"><img class=\"aligncenter size-full wp-image-25038\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/multiple-select-with-groups.png?resize=363%2C257\" alt=\"multiple-select-with-groups\" /></a></p>\n<p>Those are just a couple of examples of how Chosen makes long, unwieldy select boxes more user-friendly. The <a href=\"http://harvesthq.github.io/chosen/\" target=\"_blank\">project demo page </a>includes additional examples and instructions on how to customize the default text, change the no results text, limit selected options, add right to left support and much more.</p>\n<h3>Chosen for WordPress</h3>\n<p>The good news for WordPress users is that <a href=\"http://find.brentshepherd.com/\" target=\"_blank\">Brent Shepherd</a> wrote a plugin that utilizes Chosen with select boxes in posts and pages. If your site has a form with a long select box, you may want to check out <a href=\"http://wordpress.org/plugins/chosen/\" target=\"_blank\">Chosen for WordPress</a>.</p>\n<p>It applies Chosen to any select box within post or page content and will only load the relevant JS and CSS files if a select box is included in your form. The plugin has support out of the box for the [ contact-form ] shortcode which is used by the Grunion Contact form, Contact Form 7, and Jetpack. You can also force the Chosen script and styles to load on a page by including the [ chosen ] shortcode.</p>\n<p>Chosen works nicely for contact forms that have long location select boxes or questions with a limited list of possible answers. Another excellent use case for the script is with BuddyPress profile fields. Profile questions are a common place where you might find long, cumbersome select boxes. Putting the power of Chosen to work for BuddyPress would be a welcome addition to the compatibility already included for contact form plugins.</p>\n<p>Browser support includes Firefox, Chrome, Safari and IE9. Chosen also has legacy support for IE8. Please note that the script is currently disabled on iPhone, iPod Touch, and Android mobile devices.</p>\n<p>If you like how Chosen transforms select boxes, you can download <a href=\"http://wordpress.org/plugins/chosen/\" target=\"_blank\">Chosen for WordPress</a> for free from the official plugin directory.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 19 Jun 2014 20:38:31 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:25;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"WordPress.tv: Steven Slack: Information Architecture Has Everything To Do With Your Theme\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"