";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"WordPress.tv: Keeping Up Your Site: Maintenance, Monetization, and Self-Branding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wordpress.tv/?p=35775\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"http://wordpress.tv/2014/06/19/keeping-up-your-site-maintenance-monetization-and-self-branding/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:716:\"<div id=\"v-zoFmlSC4-1\" class=\"video-player\">\n</div><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/35775/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/35775/\" /></a> <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=35775&subd=wptv&ref=&feed=1\" width=\"1\" height=\"1\" /><div><a href=\"http://wordpress.tv/2014/06/19/keeping-up-your-site-maintenance-monetization-and-self-branding/\"><img alt=\"Keeping Up Your Site: Maintenance, Monetization, and Self-Branding\" src=\"http://videos.videopress.com/zoFmlSC4/keeping-up-with-your-site_std.original.jpg\" width=\"160\" height=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 19 Jun 2014 18:10:04 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"WordPress.tv\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:28;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"WPTavern: What’s Your Perception Of ThemeForest?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=24827\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:136:\"http://wptavern.com/whats-your-perception-of-themeforest?utm_source=rss&utm_medium=rss&utm_campaign=whats-your-perception-of-themeforest\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3782:\"<p>Philip Arthur Moore has <a title=\"https://philiparthurmoore.com/ruining-wordpress/\" href=\"https://philiparthurmoore.com/ruining-wordpress/\">published a great post</a> that I think strikes a nerve for many. Although the entire article is blockquote worthy, I think the most important point he made is that WordPress developers need to step up their game and stop contributing to the perception that WordPress sucks.</p>\n<p>Whether you&#8217;re a theme or plugin developer, turning on <a title=\"http://codex.wordpress.org/WP_DEBUG\" href=\"http://codex.wordpress.org/WP_DEBUG\">WP_DEBUG</a> only helps you. It&#8217;s a simple step and helps catch general coding errors before shipping products. Later in the article, Moore requested that ThemeForest sellers turn on WP_DEBUG before selling a theme.</p>\n<blockquote><p>All ThemeForest authors need to turn on <a href=\"https://core.trac.wordpress.org/ticket/28551\"><code>WP_DEBUG</code></a>. I don’t care about your GPL choices or your mega-menus or your features arms race towards taking a 70% cut on $40 USD for an unsustainable lifetime of support and free updates. All I care about is that you turn on <a href=\"https://core.trac.wordpress.org/ticket/28551\"><code>WP_DEBUG</code></a>. Your buggy products are hurting WordPress and making everyone in the WordPress community miserable, from support people to developers to consumers. You’re ruining trust in WordPress and you’re making the platform seem amateurish and childish.</p></blockquote>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2010/09/themeforestlogo.png\" rel=\"prettyphoto[24827]\"><img class=\"alignright size-full wp-image-4550\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2010/09/themeforestlogo.png?resize=295%2C150\" alt=\"theme forest logo\" /></a>ThemeForest is a huge presence in the community.  It&#8217;s the go to marketplace for commercial WordPress themes for several users, so it&#8217;s really important that the marketplace does everything it can to encourage <a title=\"http://codex.wordpress.org/WordPress_Coding_Standards\" href=\"http://codex.wordpress.org/WordPress_Coding_Standards\">best practices</a>. In fact, their <a title=\"http://support.envato.com/index.php?/Knowledgebase/Article/View/472\" href=\"http://support.envato.com/index.php?/Knowledgebase/Article/View/472\">theme submission guidelines</a> specifically state that, &#8220;Themes must not have any PHP notices, warnings, or errors &#8211; please develop with errors enabled, and <a href=\"http://codex.wordpress.org/WP_DEBUG\"><em>WP_DEBUG</em></a> set to <em>true</em>.&#8221; There&#8217;s no excuse for ThemeForest themes to generate errors.</p>\n<p>That brings me to my poll question.</p>\nNote: There is a poll embedded within this post, please visit the site to participate in this post\'s poll.\n<p>Based on everything I&#8217;ve read and the commercial plugin developers I&#8217;ve talked to, the perception of ThemeForest is that it&#8217;s a place to buy good-looking, poorly coded themes. I&#8217;ve never purchased a theme from them myself, but have <a title=\"http://wptavern.com/wpweekly-episode-137-making-a-living-on-themeforest-with-jonathan-atkinson\" href=\"http://wptavern.com/wpweekly-episode-137-making-a-living-on-themeforest-with-jonathan-atkinson\">interviewed theme sellers such as Jonathan Atkinson</a> doing their part to try to change this mind-set.</p>\n<p>Ironically, the comments on Moore&#8217;s post have been disabled <a title=\"http://wptavern.com/why-comments-still-matter\" href=\"http://wptavern.com/why-comments-still-matter\">which is terrible</a> considering he raised a number of great discussion points. What do you think of his article and the general idea that every developer is responsible for the perception of WordPress?</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 19 Jun 2014 01:33:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:29;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"WPTavern: WordCamp San Francisco to Host WordPress Community Summit and Contributor Meetups\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=24974\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:226:\"http://wptavern.com/wordcamp-san-francisco-to-host-wordpress-community-summit-and-contributor-meetups?utm_source=rss&utm_medium=rss&utm_campaign=wordcamp-san-francisco-to-host-wordpress-community-summit-and-contributor-meetups\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2723:\"<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/06/wcsf.jpeg\" rel=\"prettyphoto[24974]\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/06/wcsf.jpeg?resize=810%2C300\" alt=\"wcsf\" class=\"aligncenter size-full wp-image-24984\" /></a></p>\n<p><a href=\"http://2014.sf.wordcamp.org/\" target=\"_blank\">WordCamp San Francisco</a> is one of the most important WordPress events of the year. Contributors from all over the globe travel to connect and inspire one another at the event where Matt Mullenweg traditionally delivers the annual State of the Word address.</p>\n<p>This year the activities will be spread out over five days to incorporate community and contributor events. Saturday and Sunday, October 25-26 will will be dedicated to the 2-track WordCamp conference at <a href=\"http://2014.sf.wordcamp.org/location/\" target=\"_blank\">Mission Bay Conference Center</a>. The organization team expects approximately 800 attendees. Applications for <a href=\"http://2014.sf.wordcamp.org/2014/06/16/speaking-at-wordcamp-san-francisco/\" target=\"_blank\">speaking at WordCamp San Francisco</a> are now open, and you can even nominate speakers for the event.</p>\n<p>The <a href=\"http://2014.sf.wordcamp.org/schedule/community-summit/\" target=\"_blank\">WordPress Community Summit</a>  will take place on Monday, October 27. Unlike the first summit, which was held in 2012 by invitation only, this year&#8217;s event will have an open signup form. Signups will be reviewed in order to ensure each attendee&#8217;s involvement in the open source project.</p>\n<p>Tuesday and Wednesday, October 28-29, will be dedicated to <a href=\"http://2014.sf.wordcamp.org/schedule/contributor-team-meetups/\" target=\"_blank\">mini-meetups for WordPress contributor teams</a> where they will connect in person and work on projects together. The agenda and goals for these days will be decided in advance on the team blogs.</p>\n<p>WordCamp San Francisco organizers are expanding the <a href=\"http://2014.sf.wordcamp.org/location/travel-assistance/\" target=\"_blank\">travel assistance program</a> this year in order to help bring in a more diverse group of WordPress contributors, users, and educators. The <a href=\"http://2014.sf.wordcamp.org/location/travel-assistance/\" target=\"_blank\">application</a> deadline for travel assistance is June 30, 2014. Anyone who is unable to attend the event without financial assistance is encouraged to apply.</p>\n<p>If you want to get in on a week&#8217;s worth of top-notch WordPress events, make sure to put the WordCamp San Francisco dates on your calendar. Follow <a href=\"https://twitter.com/WordCampSF\" target=\"_blank\">@WordCampSF</a> on Twitter to find out when tickets go on sale.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 18 Jun 2014 23:17:16 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:30;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"WPTavern: Ravel By ThemeHybrid Is A Modern WordPress Theme Designed By Tung Do\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=24911\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:200:\"http://wptavern.com/ravel-by-themehybrid-is-a-modern-wordpress-theme-designed-by-tung-do?utm_source=rss&utm_medium=rss&utm_campaign=ravel-by-themehybrid-is-a-modern-wordpress-theme-designed-by-tung-do\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5026:\"<p>Ravel is a <a title=\"http://themehybrid.com/weblog/ravel-wordpress-theme\" href=\"http://themehybrid.com/weblog/ravel-wordpress-theme\">free new WordPress theme</a> released by ThemeHybrid with a focus on blog, portfolio, and professional sites. It&#8217;s the result of teamwork between Justin Tadlock and Tung Do. Ravel is slick, modern, and has an eye pleasing color scheme.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/RavelScreenshot.jpg\" rel=\"prettyphoto[24911]\"><img class=\"aligncenter size-full wp-image-24946\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/RavelScreenshot.jpg?resize=800%2C709\" alt=\"Screenshot Of Ravel\" /></a>One of my favorite features of Ravel is the social icons that blend in seamlessly with the design. Ravel also makes use of <a title=\"http://justintadlock.com/archives/2013/08/07/social-media-nav-menus\" href=\"http://justintadlock.com/archives/2013/08/07/social-media-nav-menus\">Tadlock&#8217;s technique</a> of using menus to add social media links making it easy to add and remove buttons. If you&#8217;re planning on using this theme to blog, the content width is only 540 pixels which is a bit cramped for my liking. Because of the cramped content space and the sidebar, it&#8217;s easy to have a post title look like a paragraph. I&#8217;d like to see at least 600 pixels dedicated to the blog portion of the theme.</p>\n<div id=\"attachment_24951\" class=\"wp-caption aligncenter\"><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/06/SmallContentWidthInRavel.png\" rel=\"prettyphoto[24911]\"><img class=\"size-full wp-image-24951\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/06/SmallContentWidthInRavel.png?resize=1025%2C285\" alt=\"Post Titles Can Easily Look Like Paragraphs\" /></a><p class=\"wp-caption-text\">Post Titles Can Easily Look Like Paragraphs</p></div>\n<p>The theme is responsive but instead of shoving all of the sidebar widgets below the site, Ravel keeps the sidebar as is and hides it. It&#8217;s accessible via a red icon that expands or contracts the sidebar. I&#8217;m curious as to whether users prefer this method over the typical behavior.</p>\n<div id=\"attachment_24953\" class=\"wp-caption aligncenter\"><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/ResponsiveSidebar.png\" rel=\"prettyphoto[24911]\"><img class=\"size-full wp-image-24953\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/ResponsiveSidebar.png?resize=940%2C633\" alt=\"Expanding or Hiding The Sidebar In Ravel\" /></a><p class=\"wp-caption-text\">Expanding or Hiding The Sidebar In Ravel</p></div>\n<p>Ravel has built-in support for the <a title=\"http://themehybrid.com/plugins/custom-content-portfolio\" href=\"http://themehybrid.com/plugins/custom-content-portfolio\">Custom Content Portfolio</a> plugin. This plugin allows you to manage your portfolio of design, photography, and other artwork. One of the other nice features is the custom made tabs widget. You&#8217;ll find it in the widgets administration area labeled as <strong>Ravel Tabs</strong>. Ravel Tabs is like four widgets in one. It displays recent <em>posts</em>, <em>popular posts</em>, <em>recent comments</em>, and a <em>tag cloud</em>. (Do people still use tag clouds anymore?) Tabbed widget plugins can be finicky to configure and sometimes, they don&#8217;t work well with themes. Ravel Tabs works great and is easy to configure.</p>\n<p>Ravel contains an introductory template. This is great to use as your site&#8217;s frontpage instead of the most recent blog posts. One feature that sets ThemeHybrid themes apart from others is the use of <a title=\"http://codex.wordpress.org/Function_Reference/add_editor_style\" href=\"http://codex.wordpress.org/Function_Reference/add_editor_style\">custom styles</a> for the visual editor. This stylesheet enables the visual editor to take on the look and feel of the frontend of the site, delivering a <em>what you see is what you get</em> experience. Although I prefer a darker style for the visual editor, I wonder if users will see it as a downside because of the contrast difference between the surrounding meta boxes and the editor.</p>\n<div id=\"attachment_24965\" class=\"wp-caption aligncenter\"><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/06/VisualEditorStyleInRavel.png\" rel=\"prettyphoto[24911]\"><img class=\"size-full wp-image-24965\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/06/VisualEditorStyleInRavel.png?resize=920%2C683\" alt=\"Visual Editor Style Matches The Frontend Of Ravel\" /></a><p class=\"wp-caption-text\">Visual Editor Style Matches The Frontend Of Ravel</p></div>\n<p>Ravel is a great looking theme that has a look and style I&#8217;d pay for. It&#8217;s available for free from <a title=\"http://themehybrid.com/themes/ravel\" href=\"http://themehybrid.com/themes/ravel\">ThemeHybrid</a> and soon, the WordPress.org Theme Directory. Tadlock said the theme has already been submitted to the directory and that&#8217;s where future updates will come from.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 18 Jun 2014 21:08:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:31;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"WPTavern: WordPress Themes Suck at Accessibility: It’s Time to Fix It\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=24915\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:178:\"http://wptavern.com/wordpress-themes-suck-at-accessibility-its-time-to-fix-it?utm_source=rss&utm_medium=rss&utm_campaign=wordpress-themes-suck-at-accessibility-its-time-to-fix-it\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:11140:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/simone.png\" rel=\"prettyphoto[24915]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/simone.png?resize=300%2C224\" alt=\"simone\" class=\"alignright size-medium wp-image-24929\" /></a>Earlier this month WordPress developer <a href=\"http://mor10.com/\" target=\"_blank\">Morten Rand-Hendriksen</a> released <a href=\"http://wordpress.org/themes/simone\" target=\"_blank\">Simone</a>, a free theme based on <a href=\"http://underscores.me/\" target=\"_blank\">Underscores</a>. Like many themes, Simone is responsive, wired for translation, utilizes the customizer, and includes editor styles. One feature, however, sets Simone apart &#8211; a heavy emphasis on accessibility.</p>\n<p>Rand-Hendriksen believes that the accessibility-ready tag should be <a href=\"http://mor10.com/accessibility-ready-tag-required-wordpress-themes/\" target=\"_blank\">required for all WordPress themes</a>. <strong>&#8220;My main inspiration for accessibility is that I want everyone, regardless of accessibility challenges, to be able to access all content on the web in the way they want and/or need,&#8221;</strong> he said. To that end, he has educated himself on the requirements for making a WordPress theme accessible. He is, however, only one among a very small minority of theme developers to do so.</p>\n<h3>WordPress Themes Lag in Meeting Accessibility Guidelines</h3>\n<p>&#8220;The alarming reality is only a handful of WordPress themes (and thus WordPress-powered sites) meet basic accessibility guidelines,&#8221; Rand-Hendriksen said. As WordPress powers an ever-increasing segment of the web, the platform and its themes play a big role in the accessibility of the web as a whole.</p>\n<p>&#8220;<span class=\"pullquote alignleft\">Accessibility can no longer be treated as a bonus feature</span>,&#8221; Rand-Hendriksen told the Tavern. &#8220;In many countries it is now a legislated requirement and that trend will likely go global in a few years.&#8221;</p>\n<p>When examining the official WordPress Themes Directory, you&#8217;ll be hard-pressed to find much of a selection when it comes to <a href=\"http://wordpress.org/themes/tags/accessibility-ready\" target=\"_blank\">accessibility-ready</a> themes. In fact, there&#8217;s only one page of them. Rand-Hendriksen calculates that accessibility-ready themes account for &#8220;a dismal 0.5%,&#8221; and said that the directory is severely lagging in regard to presenting options.</p>\n<p>One major reason for this is that theme developers mistakenly believe that meeting accessibility guidelines is only for the experts. <strong>&#8220;In building Simone I wanted to prove that building an accessibility-ready theme is not hard and does not require a lot of extra work,&#8221;</strong> Rand-Hendriksen said. He believes that if you can follow web standards, then you can build accessible WordPress themes.</p>\n<blockquote><p>For the most part, the challenges involved in web accessibility are imaginary and based on the myth that accessibility is hard and expensive. Here&#8217;s the thing: It&#8217;s neither. Web accessibility mainly has to do with following web standards and coding for content first. This does require a bit of a reframing of the development process which historically is mainly focused on getting code to match intricate designs, but that is not a hindrance.</p></blockquote>\n<p>Rand-Hendriksen chose <a href=\"http://underscores.me/\" target=\"_blank\">Underscores</a> as a base for Simone because it meets nearly all of the <a href=\"http://make.wordpress.org/themes/guidelines/guidelines-accessibility/\" target=\"_blank\">requirements for using the accessibility-ready tag</a> on a WordPress theme.  He subsequently submitted two patches to _s that got baked in to get it even closer to the specifications. From there the only thing remaining was to make the drop-down menu keyboard accessible and continue following web and WCAG standards as he built the theme.</p>\n<h3>Resources for Building Accessibility as a Baseline Requirement</h3>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/05/guided-road.jpg\" rel=\"prettyphoto[24915]\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/05/guided-road.jpg?resize=900%2C421\" alt=\"guided-road\" class=\"aligncenter size-full wp-image-22575\" /></a></p>\n<p>Rand-Hendriksen&#8217;s advice for theme developers looking to build accessibility-ready themes: Change your mindset so that accessibility considerations are no longer an afterthought.</p>\n<blockquote><p>The key is to build accessibility in as a baseline requirement, not a feature added on after the fact. When you start building accessibility in as a baseline you discover your code gets more structured, easier to understand, and as a developer you start caring more about the content itself, not just how to bend to the will of the design.</p></blockquote>\n<p>Once you&#8217;ve made up your mind to develop accessible themes, there are many excellent resources available to help you. &#8220;The Accessibility Project recently published a set of <a href=\"http://wptavern.com/ http://a11yproject.com/patterns/\" target=\"_blank\">living patterns</a> that can be baked into any project,&#8221; Rand-Hendriksen advised. His next step on the Simone theme is to swap out the currently accessible (albeit a bit clunky) Superfish menu for the one proposed in the pattern library.</p>\n<p>Rand-Hendriksen cites the <a href=\"http://make.wordpress.org/themes/guidelines/guidelines-accessibility/\" target=\"_blank\">WordPress Theme Accessibility Guidelines</a> as a helpful resource for keeping your theme on the right track. The instructions there are straight-forward and easy to follow and understand. &#8220;Most of them are just web standards that should be followed anyway,&#8221; he said.</p>\n<p>He outlined the process for submitting an accessibility-ready theme to WordPress.org:</p>\n<blockquote><p>Once a theme is submitted to the Directory with the accessibility-tag applied it will be manually tested by the WP Accessibility Team (currently Joe Dolson is the sole person responsible for doing this). They (or rather he) will go through the theme with a fine-toothed comb, test everything, and come back with very detailed instructions on what, if anything, needs to be changed.</p></blockquote>\n<p>Rand-Hendriksen believes that the process doesn&#8217;t have to be complicated. His advice? Start with _s, add in a solution for a keyboard accessible menu, and follow web standards. You&#8217;ll be well on your way to being able to use that accessibility-ready tag.</p>\n<p>&#8220;In addition, I run my themes through a set of manual tests that include disabling my mouse and working with the theme for several hours, using <a href=\"https://chrome.google.com/webstore/detail/chromevox/kgejglhpjiefppelpmljglcjbhoiplfn?hl=en\" target=\"_blank\">ChromeVox</a> to experience the theme through a screen reader, and using voice commands and screen readers on mobile devices to make sure everything works as expected.&#8221;</p>\n<p>For ensuring that contrasts are high enough, Rand-Hendriksen recommends the<a href=\"http://leaverou.github.io/contrast-ratio/\" target=\"_blank\"> Contrast Ratio tool</a> built by Lea Verou.</p>\n<h3>7 Practical Tips for Developing Accessible WordPress Themes</h3>\n<p>Most WordPress theme developers don&#8217;t consider themselves to be accessibility experts. In reality, you already have all of the knowledge and tools you need to start getting your themes up to standards. Someday, meeting accessibility requirements may be mandated by law, so if you want to be ahead of the game you should start now.</p>\n<p>How can you make accessibility part of your standard baseline for all projects? In summary, a few of the practical takeaways from our interview with Morten Rand-Hendriksen include:</p>\n<ul>\n<li>Get a new mindset: Build accessibility in as a baseline requirement, not a feature added on after the fact.</li>\n<li>If you don&#8217;t know where to start, try <a href=\"http://underscores.me/\" target=\"_blank\">Underscores</a> as a base theme for meeting most of the requirements</li>\n<li>Check out the Accessibility Project&#8217;s <a href=\"http://a11yproject.com/patterns/\" target=\"_blank\">widget and pattern library</a></li>\n<li>Familiarize yourself with <a href=\"http://make.wordpress.org/themes/guidelines/guidelines-accessibility/\" target=\"_blank\">WordPress&#8217; guidelines for the accessibility-ready tag</a>\n<li>Try disabling your mouse and working with your theme with <a href=\"https://chrome.google.com/webstore/detail/chromevox/kgejglhpjiefppelpmljglcjbhoiplfn?hl=en\" target=\"_blank\">ChromeVox</a></li>\n<li>Use voice commands and screen readers on mobile devices to make sure everything works</li>\n<li>Make sure contrast ratios are high enough using this <a href=\"http://leaverou.github.io/contrast-ratio/\" target=\"_blank\">handy tool</a> built by Lea Verou</li>\n</ul>\n<h3>Why is Accessibility Such a Big Deal?</h3>\n<p><div id=\"attachment_24960\" class=\"wp-caption aligncenter\"><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/prevailing-sentiment.jpg\" rel=\"prettyphoto[24915]\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/prevailing-sentiment.jpg?resize=1024%2C429\" alt=\"photo credit: allaboutgeorge - cc\" class=\"size-full wp-image-24960\" /></a><p class=\"wp-caption-text\">photo credit: <a href=\"http://www.flickr.com/photos/allaboutgeorge/2325230694/\">allaboutgeorge</a> &#8211; <a href=\"http://creativecommons.org/licenses/by/2.0/\">cc</a></p></div>If the dire lack of accessible WordPress themes on WordPress.org is any indication, then 99%+ of WordPress theme developers have no concern for accessibility. The rationale behind not caring is usually something like this: <strong>The vast majority of the people who access my website will not be disabled at all, so why should I care?</strong></p>\n<p>Rand-Hendriksen believes that accessibility is a rights issue:</p>\n<blockquote><p>As I mentioned earlier accessibility is now becoming a legislated requirement in many countries. This is because accessibility is a rights issue. To put it bluntly, if you are building a website that is not accessible you are discriminating against anyone with accessibility challenges. Those are not my words by the way: That&#8217;s the reasoning used by several governments including the government of Norway for passing accessibility laws.</p></blockquote>\n<p>The situation may soon become critical as accessibility mandates are adopted by more countries. <strong>&#8220;WordPress is facing a huge challenge here because once these laws kick in (in many places later this year) website owners running WordPress will for the most part be in breach of the laws thanks to the almost universal lack of accessibility support in WordPress themes</strong>,&#8221; Rand-Hendriksen said.</p>\n<p>His warning applies to both self-hosted WordPress sites and WordPress.com sites: &#8220;If we as a community don&#8217;t embrace accessibility now we will quickly paint ourselves into a corner it&#8217;ll be hard to escape from.&#8221;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 18 Jun 2014 20:32:56 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:32;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"WordPress.tv: How to Create Appealing Contents and Spread the Word\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wordpress.tv/?p=35787\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"http://wordpress.tv/2014/06/18/how-to-create-appealing-contents-and-spread-the-word/\";s:7:\"at