:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wordpress.tv/?p=35780\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"http://wordpress.tv/2014/06/18/sara-rosso-wordpress-use-cases-in-enterprise-media-and-government-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:742:\"<div id=\"v-2jGG37f7-1\" class=\"video-player\">\n</div><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/35780/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/35780/\" /></a> <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=35780&subd=wptv&ref=&feed=1\" width=\"1\" height=\"1\" /><div><a href=\"http://wordpress.tv/2014/06/18/sara-rosso-wordpress-use-cases-in-enterprise-media-and-government-1/\"><img alt=\"Sara Rosso: WordPress Use Cases in Enterprise, Media, and Government (1/2)\" src=\"http://videos.videopress.com/2jGG37f7/wordpress-enterprise-media-government-1_std.original.jpg\" width=\"160\" height=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 18 Jun 2014 18:01:04 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"WordPress.tv\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:35;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"WPTavern: WordPress Developer Resource Hookr.io Now With Improved Search\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=24865\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:188:\"http://wptavern.com/wordpress-developer-resource-hookr-io-now-with-improved-search?utm_source=rss&utm_medium=rss&utm_campaign=wordpress-developer-resource-hookr-io-now-with-improved-search\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2157:\"<p><a title=\"http://hookr.io/\" href=\"http://hookr.io/\">Hookr.io</a>, the WordPress developer resource that <a title=\"http://wptavern.com/introducing-hookr-io-a-new-resource-for-wordpress-developers\" href=\"http://wptavern.com/introducing-hookr-io-a-new-resource-for-wordpress-developers\">launched earlier this year</a> has undergone a series of improvements. The search engine now shows results as your typing. The detailed results page has been completely redesigned making it easier to read. If the source code contains indexed objects such as actions, filters, functions, etc, those items are hyper-linked for ease of navigation. Additionally, those objects are highlighted by a gaussian blur effect removing unrelated items from the source code.</p>\n<a href=\"http://wptavern.com/wordpress-developer-resource-hookr-io-now-with-improved-search#gallery-24865-1-slideshow\">Click to view slideshow.</a>\n<p>I asked Christopher Sanford what the traffic has been like since the launch. Sanford is seeing about 40% returning visitors but cites sparse information and functionality as the culprit. The first alpha version of the site inaccurately displayed the hook count which has since been corrected. Several people also commented that they use <a title=\"http://adambrown.info/p/wp_hooks\" href=\"http://adambrown.info/p/wp_hooks\">Adam Browns hook database</a> which Sanford is using as a baseline to compare notes against.</p>\n<p>When asked how Hookr.io compares to the <a title=\"https://developer.wordpress.org/reference/\" href=\"https://developer.wordpress.org/reference/\">official WordPress code reference</a> site, Sanford said, &#8220;the user experience is consistent with <a href=\"http://wordpress.org\">wordpress.org</a>&#8220;. The beta version of the site is already being worked on and if all goes well, Sanford hopes to release it prior to attending <a title=\"http://2014.nyc.wordcamp.org/\" href=\"http://2014.nyc.wordcamp.org/\">WordCamp New York City</a> in August. &#8220;Ultimately, the goal of the site is for developers to obtain relevant information without incessant clicking, which I feel Alpha 2 is beginning to fulfill this vision.&#8221;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 17 Jun 2014 20:42:39 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:36;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"WPTavern: Preview the WordPress Menu Customizer: Alpha Plugin Ready for Testing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=24860\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:200:\"http://wptavern.com/preview-the-wordpress-menu-customizer-alpha-plugin-ready-for-testing?utm_source=rss&utm_medium=rss&utm_campaign=preview-the-wordpress-menu-customizer-alpha-plugin-ready-for-testing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4846:\"<p><a href=\"http://wptavern.com/wordpress-3-9-smith-released\" target=\"_blank\">WordPress 3.9</a> made huge strides toward improving the theme customization experience by adding widgets to the customizer for live previews. But have you ever thought about the possibility of setting up your WordPress menus within the customizer?</p>\n<p><a href=\"http://celloexpressions.com/\" target=\"_blank\">Nick Halsey</a> is tackling this as part of his Google Summer of Code 2014 Project and has just released an <a href=\"http://wordpress.org/plugins/menu-customizer/\" target=\"_blank\">alpha plugin</a> for testing the menu customizer. It will be under heavy development throughout the summer and certain features will require core patches. Using the plugin requires the latest trunk version of WordPress (4.0).</p>\n<p>Halsey explains his larger vision for the project in the original <a href=\"http://celloexpressions.com/blog/gsoc-project-proposal-menu-customizer/\" target=\"_blank\">proposal,</a> which reaches beyond simply bringing menus into the customizer. The goal is to help mature the customizer into a tool that can realistically be used for live editing anything on the frontend, in cooperation with the planned frontend content editor:</p>\n<blockquote><p>Once the Customizer is feature-complete, we can begin to experiment with alternative approaches to accessing the customizer, making it feel more like an editing mode on the front-end of the site, alongside the front-end content-editor</p></blockquote>\n<p>He is developing the plugin with backwards compatibility and with the hopes of it being something that can be added to core later this year, although there are no guarantees. In the <a href=\"http://celloexpressions.com/blog/gsoc-menu-customizer-revised-schedulescope/\" target=\"_blank\">revised project scope</a>, Halsey suggests that the menu customizer could potentially replace the existing menus screen for supported users. At the beginning of August he plans to prepare a core patch for the plugin merge and draft a proposal for its inclusion in core.</p>\n<h3>A Preview of the Menu Customizer Plugin</h3>\n<p>The Menu Customizer provides a convenient way to assign locations for menus within the theme&#8217;s available options:</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/theme-locations.png\" rel=\"prettyphoto[24860]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/theme-locations.png?resize=1025%2C620\" alt=\"theme-locations\" class=\"aligncenter size-full wp-image-24878\" /></a></p>\n<p>It also allows for editing, reordering, deleting, and adding individual menu items within any menu:</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/customize-menu.png\" rel=\"prettyphoto[24860]\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/customize-menu.png?resize=1025%2C487\" alt=\"customize-menu\" class=\"aligncenter size-full wp-image-24880\" /></a></p>\n<p>Currently, the process of adding links seems rather complex and a bit chaotic, even for a seasoned WordPress user. Longer menus and those that are deep-nested have the potential to become quite unwieldly to manage within the narrow customizer controls area.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/add-links.png\" rel=\"prettyphoto[24860]\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/add-links.png?resize=937%2C599\" alt=\"add-links\" class=\"aligncenter size-full wp-image-24892\" /></a></p>\n<p>Halsey is well-aware of these challenges and in the coming weeks he will be addressing the need to implement screen options into the new menus interface. His GSoC project includes time for working through outstanding issues with implementation and responding to UI/UX feedback from the core team and community.</p>\n<p>The ability to customize menus and set their locations within the theme customizer is convenient, especially for those who are new to WordPress. Finding just a few options in the customizer while also having to hunt around the dashboard to make other frontend changes can be confusing. One of the more difficult challenges here will be for UI/UX contributors to ensure that menu management in the customizer is just as easy as it would be in the dashboard.</p>\n<p>To follow along with the progress, check out the <a href=\"http://celloexpressions.com/blog/gsoc-menu-customizer-revised-schedulescope/\" target=\"_blank\">revised scope</a> and its related <a href=\"https://core.trac.wordpress.org/my-patches?USER=celloexpressions\" target=\"_blank\">core patches</a>. If you&#8217;re feeling adventurous and want to try out the plugin, make sure to install the <a href=\"http://wordpress.org/plugins/menu-customizer/\" target=\"_blank\">Menu Customizer</a> on a test site only, as it&#8217;s still very alpha and not yet ready for use in production.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 17 Jun 2014 20:13:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";