eight=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 17 Jun 2014 18:25:09 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"WordPress.tv\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:40;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"WPTavern: Eighties: A Bold Free WordPress Theme Focused on Content\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=24812\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:174:\"http://wptavern.com/eighties-a-bold-free-wordpress-theme-focused-on-content?utm_source=rss&utm_medium=rss&utm_campaign=eighties-a-bold-free-wordpress-theme-focused-on-content\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3309:\"<p>WordPress themes are getting simpler and bolder this year. Bloggers are gravitating toward designs that feature large typography and scaled back post meta in order to allow the visitor to focus on the main content. To compliment this design style, many theme developers are opting to keep the peripherals (widgets, menus, etc) hidden from view.</p>\n<p><a href=\"http://kopepasah.com/\" target=\"_blank\">Justin Kopepasah</a> is making his debut in the WordPress Themes Directory with <a href=\"http://wordpress.org/themes/eighties\" target=\"_blank\">Eighties</a>, a beautiful new theme that epitomizes the simple, bold style trending with new blogging themes. Despite the iconic name, the Eighties theme is not actually a tribute to big hair, leg warmers and the Cold War. Kopepasah said the theme was inspired by his favorite <a href=\"http://chriskempson.github.io/base16/#eighties\" target=\"_blank\">color scheme</a>.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/eighties.png\" rel=\"prettyphoto[24812]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/eighties.png?resize=880%2C660\" alt=\"eighties\" class=\"aligncenter size-full wp-image-24821\" /></a></p>\n<p>Eighties was created based on the <a href=\"http://underscores.me/\" target=\"_blank\">_s theme by Automattic</a>. It was designed to keep the menu and sidebar out of the way until the visitor toggles them into view.</p>\n<p>The theme offers just a couple of customization options to make it your own, including the ability to set your own header and header text color. You can add widgets to the pop out sidebar area or the footer. It ships with the image you see in the header, so making your site look exactly like the demo takes no time at all.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/eighties-customizer.png\" rel=\"prettyphoto[24812]\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/eighties-customizer.png?resize=1025%2C557\" alt=\"eighties-customizer\" class=\"aligncenter size-full wp-image-24819\" /></a></p>\n<p>Eighties includes support for several Jetpack modules. <a href=\"http://eighties.me/portfolio/\" target=\"_blank\">Portfolios</a> are a unique feature included in this theme if you use Jetpack (coming soon) or blog on WordPress.com. It includes styles for showcasing your projects with the <a href=\"http://en.support.wordpress.com/portfolios/\" target=\"_blank\">portfolio custom post type</a>.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/portfolio.png\" rel=\"prettyphoto[24812]\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/portfolio.png?resize=1025%2C650\" alt=\"portfolio\" class=\"aligncenter size-full wp-image-24840\" /></a></p>\n<p>You can check out a live demo of the theme in action at <a href=\"http://eighties.me/\" target=\"_blank\">eighties.me</a>.</p>\n<p>The Eighties theme was designed to give readers the content they&#8217;re looking for without all the extra fluff. Right now, it&#8217;s only available for self-hosted WordPress sites but Kopepasah is currently waiting for approval for listing on WordPress.com. You can download <a href=\"http://wordpress.org/themes/eighties\" target=\"_blank\">Eighties</a> from WordPress.org or install it directly via your theme browser in the WordPress admin.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 17 Jun 2014 07:22:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:41;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"WPTavern: VersionPress Adopts The GPL Software License\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=24810\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:152:\"http://wptavern.com/versionpress-adopts-the-gpl-software-license?utm_source=rss&utm_medium=rss&utm_campaign=versionpress-adopts-the-gpl-software-license\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7342:\"<p>When I <a title=\"http://wptavern.com/versionpress-hopes-to-bring-version-control-to-the-masses\" href=\"http://wptavern.com/versionpress-hopes-to-bring-version-control-to-the-masses\">wrote about the VersionPress project</a> and campaign last week, a major sticking point with people was whether the project would be licensed under the GPL. After a few consultation emails and deliberation, the developers have decided the plugin <a title=\"http://versionpress.wordpress.com/2014/06/16/announcing-full-gpl-licensing/\" href=\"http://versionpress.wordpress.com/2014/06/16/announcing-full-gpl-licensing/\">will be 100% GPL licensed</a>.</p>\n<blockquote><p>When we set off with <a href=\"http://versionpress.net/\">VersionPress </a>and the crowd-funding campaign for it, we were focused on technical things and wanted to postpone the final decision on licensing. That was a mistake and you let us know loud and clear. We heard you and have an important and exciting announcement to make today: <strong>VersionPress will be 100% GNU GPL-licensed</strong>.</p></blockquote>\n<p>This is fantastic news and I hope those who are on the fence will consider <a title=\"http://versionpress.net/\" href=\"http://versionpress.net/\">backing the project</a>. For those that don&#8217;t know, the GPLv2 license gives users and developers a set of freedoms. Since <a title=\"http://wordpress.org/about/license/\" href=\"http://wordpress.org/about/license/\">WordPress is licensed under the GPL</a>, these same freedoms are passed on to everyone who uses or develops the software.</p>\n<ul>\n<li>The freedom to run the program as you wish, for any purpose (freedom 0).</li>\n<li>The freedom to study how the program works, and change it so it does your computing as you wish (freedom 1). Access to the source code is a precondition for this.</li>\n<li>The freedom to redistribute copies so you can help your neighbor (freedom 2).</li>\n<li>The freedom to distribute copies of your modified versions to others (freedom 3). By doing this you can give the whole community a chance to benefit from your changes. Access to the source code is a precondition for this.</li>\n</ul>\n<p>Matt Mullenweg has a <a title=\"http://ma.tt/2014/01/four-freedoms/\" href=\"http://ma.tt/2014/01/four-freedoms/\">great article</a> that articulates the significance of these freedoms. When VersionPress announced they were unsure of whether to license the plugin under the GPL, it&#8217;s not because they wanted to create something proprietary. It&#8217;s because they are two software developers outside of the WordPress community, unsure of how WordPress and its community works.</p>\n<h3>Helping Newcomers Understand Why The GPL License Is Important</h3>\n<p>After I published the article about VersionPress on WP Tavern last week, several people voiced their concern over the lack of licensing details. I got in touch with Borek Bernard and explained why so many people are concerned. I explained what the GPL means to the project and the WordPress community in general. I cited examples of successful WordPress product businesses that use the GPL.</p>\n<p>There are two camps of people. Those who know and understand the importance of the GPL and those who don&#8217;t care what license a product has as long as it works and is supported well. At this stage of the game, WordPress products not GPL licensed are at a serious disadvantage. You won&#8217;t get as much press and risk being ignored by influential members of the community. This is especially true for new products entering the market.</p>\n<h3>I Backed The Project With $20 and Here&#8217;s Why</h3>\n<p>Despite a working copy of VersionPress not being publicly available, I feel the same amount of excitement for the project that I did when I was given a GravityForms demonstration in 2009. I&#8217;m told there are already plugins available that provide <a title=\"http://wordpress.org/plugins/search.php?q=version+control\" href=\"http://wordpress.org/plugins/search.php?q=version+control\">version control</a> but most of them deal with content, not with the database itself. After listening to Bernard explain some of the features and how it would work in <a title=\"http://wptavern.com/wpweekly-episode-151-version-control-for-all-maybe\" href=\"http://wptavern.com/wpweekly-episode-151-version-control-for-all-maybe\">episode 151 of WordPress Weekly</a>, I&#8217;m even more excited to see the project succeed.</p>\n<div id=\"attachment_24813\" class=\"wp-caption aligncenter\"><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/VersionPressMonitorLog.png\" rel=\"prettyphoto[24810]\"><img class=\"size-full wp-image-24813\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/VersionPressMonitorLog.png?resize=525%2C330\" alt=\"VersionPress Monitor Log\" /></a><p class=\"wp-caption-text\">VersionPress Monitor Log</p></div>\n<p>For example, let&#8217;s say there&#8217;s a change you&#8217;d like to undo but you&#8217;ve published five posts since the change. Normally, you&#8217;d have to restore a backup which would reset the entire site back to that time frame. With VersionPress, you&#8217;d be able to drill down and only undo that change without losing everything that happened after it. In a future version, it could be possible to undo changes at the user level.</p>\n<p>This type of granular control over database changes is huge, especially if the interface is as simple as selecting an undo button. This plugin potentially has mass appeal but I fear that a lot of users wouldn&#8217;t understand the changes being registered to the database. Hopefully, the interface does a good job of pin-pointing what parts of WordPress are altering the database to make it easier to understand.</p>\n<h3>Getting Site Wide Revision Control In Core Will Be Difficult</h3>\n<p>Even if VersionPress doesn&#8217;t get off the ground, I&#8217;ve now been exposed to the idea and will highly support any developer or team of developers to create something like it. WordPress has support for <a title=\"http://codex.wordpress.org/Revisions\" href=\"http://codex.wordpress.org/Revisions\">Post Revisions</a> but again, that deals with content and not with other changes throughout the site. At some point, it would be great to see a revisions API built into WordPress that can monitor revisions of more than just content. Plugins could then take advantage of the API and build on top of it. There could be multiple implementations of VersionPress to choose from.</p>\n<p>The road to getting something like site wide revisions into core will be difficult. In 2013, <a href=\"http://yrnxt.com/\" target=\"_blank\">Alexander Höreth</a> participated in the Google Summer of Code project for WordPress. His project was the <a title=\"http://wordpress.org/plugins/code-revisions/\" href=\"http://wordpress.org/plugins/code-revisions/\">Code Revisions plugin</a> which would have added revision support to the code editors in WordPress. His work was never added to the core of WordPress. If that&#8217;s anything to go by, extending revision support to other areas of core may be just a pipe dream.</p>\n<p>That discussion took place nine months ago. Let&#8217;s start a new discussion on the positives and negatives of a site wide revision system in core. I know there are security issues to take note of but what other concerns do you have for such a system?</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 17 Jun 2014 04:38:58 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:42;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"WPTavern: Forbes Publishes Transcript Of Extended Interview With Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=24678\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:202:\"http://wptavern.com/forbes-publishes-transcript-of-extended-interview-with-matt-mullenweg?utm_source=rss&utm_medium=rss&utm_campaign=forbes-publishes-transcript-of-extended-interview-with-matt-mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5763:\"<p>Typically when reading interviews people have done with Matt Mullenweg, I don&#8217;t learn anything new. That&#8217;s the not the case with the <a title=\"http://www.forbes.com/sites/jjcolao/2014/06/11/an-extended-interview-with-wordpress-creator-matt-mullenweg/\" href=\"http://www.forbes.com/sites/jjcolao/2014/06/11/an-extended-interview-with-wordpress-creator-matt-mullenweg/\">extended interview he did</a> with J.J. Colao of Forbes.com. In the interview, Mullenweg goes into detail about his role of CEO at Automattic and emphasized how important mobile is within the company. Here are a few things I took away from the interview.</p>\n<div id=\"attachment_22370\" class=\"wp-caption aligncenter\"><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/05/automattic-offices.jpg\" rel=\"prettyphoto[24678]\"><img class=\"size-full wp-image-22370\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/05/automattic-offices.jpg?resize=1025%2C478\" alt=\"photo credit: Peter Slutsky\" /></a><p class=\"wp-caption-text\">photo credit: <a href=\"http://peterslutsky.com/2013/05/14/pics-touring-automattics-new-office/\">Peter Slutsky</a></p></div>\n<p>When people ask how does Automattic make money, I tell them through advertising, paid upgrades, and the VIP partner program. Mullenweg specified that WordAds and the VIP program are each 10% of the total revenue Automattic generates. Meanwhile, subscriptions make up 80% of the revenue. This makes sense but I was surprised subscriptions were that high of a percentage. I thought VIP generated the most revenue for the company based on what they charge and the types of clients they have. Then again, there are more regular users than there are VIP clients.</p>\n<p>One thing that hasn&#8217;t changed with the move to CEO is that Mullenweg still spends about a third of his time conducting interviews with new employees. If you&#8217;re interested in <a title=\"http://automattic.com/work-with-us/\" href=\"http://automattic.com/work-with-us/\">working for Automattic</a>, now is as good a time as ever to apply since the company is aggressively growing as fast as they find the best people.</p>\n<h3>Transforming Automattic Into a Mobile Company</h3>\n<p>Over the past two years, the one constant I&#8217;ve noticed in almost every interview featuring Mullenweg is his focus on mobile. This interview is no different. While Automattic has been aggressive in mobile acquisitions and new hires, the company will be training existing engineers to be mobile first. The entire company will be a mobile team instead of consisting of 10 individuals.</p>\n<blockquote><p>So in addition to our aggressive hiring on the mobile side and acquisitions, we’re going to start converting our existing engineers to be mobile first. I would hate to have to do this at a 20,000-person company because it’s hard enough as 200-person company.</p>\n<p>The mobile world is very closed and proprietary just by definition. Android is open source-ish but not really. iOS is locked down. I want to be more of a mobile company but as we do that I don’t want to lose the things that make us the engine of the independent Web.</p></blockquote>\n<h3>Is It Time For Two WordPress Mobile Apps?</h3>\n<p>As Automattic continues to increase its focus on mobile, I wonder what the future holds for the current mobile app. I use it primarily as a site management tool and not to consume content. Since Automattic loves data, I wonder if they have internal stats that show whether the WordPress mobile app is used more for managing sites or consuming content.</p>\n<div id=\"attachment_24807\" class=\"wp-caption aligncenter\"><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/WPMobileAppComposingScreen.jpg\" rel=\"prettyphoto[24678]\"><img class=\"size-full wp-image-24807\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/WPMobileAppComposingScreen.jpg?resize=1025%2C769\" alt=\"WordPress Mobile App For iOS Compose Screen\" /></a><p class=\"wp-caption-text\">WordPress Mobile App For iOS Compose Screen</p></div>\n<p>If the data shows that most people use it as a site management tool, I&#8217;d like them to consider removing Reader and the blogs I follow feature set from the app and moved into a separate WordPress.com focused app. I never use Reader, I&#8217;m not following any blogs, and I don&#8217;t have any friends on WordPress.com making almost half the app useless to me.</p>\n<p>I understand that WordPress.com and the open source WordPress project have similar feature sets, but I don&#8217;t think one app can satisfy both audiences without one or the other getting stuck with unused portions of the application. An alternative would be to create a WordPress Lite application that only gives me the features I need to manage a site. Unfortunately, every time there&#8217;s a decent alternative to the WordPress mobile app, Automattic <a title=\"http://venturebeat.com/2013/06/17/automattic-buys-poster-app/\" href=\"http://venturebeat.com/2013/06/17/automattic-buys-poster-app/\">acquires them</a>.</p>\n<p>Overall, it&#8217;s a <a title=\"http://www.forbes.com/sites/jjcolao/2014/06/11/an-extended-interview-with-wordpress-creator-matt-mullenweg/\" href=\"http://www.forbes.com/sites/jjcolao/2014/06/11/an-extended-interview-with-wordpress-creator-matt-mullenweg/\">great interview</a> but I wish the full transcript of 13,500 words was available versus 2,800. It&#8217;s also reassuring to read Mullenweg&#8217;s response when asked whether he will be with Automattic for life: &#8220;Yes. I’m kind of a one trick pony.&#8221;</p>\n<p>What do you think of splitting the app in two? Could it work or would it be too confusing? Should I give it the WordPress treatment and just ignore those areas of the app I don&#8217;t use?</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 17 Jun 2014 01:22:37 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:43;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"WPTavern: Experimental BuddyPress Plugin Adds Finer Controls for Public Groups\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=24769\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:200:\"http://wptavern.com/experimental-buddypress-plugin-adds-finer-controls-for-public-groups?utm_source=rss&utm_medium=rss&utm_campaign=experimental-buddypress-plugin-adds-finer-controls-for-public-groups\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5729:\"<div id=\"attachment_24792\" class=\"wp-caption aligncenter\"><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/group.jpg\" rel=\"prettyphoto[24769]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/group.jpg?resize=1025%2C525\" alt=\"photo credit: avrene - cc\" class=\"size-full wp-image-24792\" /></a><p class=\"wp-caption-text\">photo credit: <a href=\"http://www.flickr.com/photos/enerva/14186751646/\">avrene</a> &#8211; <a href=\"http://creativecommons.org/licenses/by/2.0/\">cc</a></p></div>\n<p><a href=\"http://buddypress.org/about/groups/\" target=\"_blank\">BuddyPress Groups</a> are one of the more social components of the plugin, as they&#8217;re used primarily for bringing members together around a shared interest, goal, or collaborative project. In some ways groups are like their own mini-networks within a social network, each having its own homepage, activity stream, member directory and administrative panel.</p>\n<p>Groups are a highly effective way of organizing members and as such have been extended to serve a multitude of different requirements. Search WordPress.org and you&#8217;ll find a couple dozen pages of <a href=\"http://wordpress.org/plugins/search.php?page=4&q=buddypress+groups\" target=\"_blank\">plugins devoted to BuddyPress groups</a>, with extensions that add new functionality, such as email subscriptions, documents, reviews, blogs, chat, and so much more. We&#8217;re going to look at how the basic group settings can be changed in order to provide more pathways for the creation of different kinds of groups.</p>\n<h3>A Brief Overview of BuddyPress Group Privacy Options</h3>\n<p>BuddyPress has three privacy options for setting up groups: Public, Private, or Hidden. When you create a group at /groups/create, you&#8217;ll find the privacy options located under settings.</p>\n<p>Anyone can join a public group and all of the activity and content are public. Private groups require users to request membership, while hidden groups are invitation only. Private and hidden groups are similar in that the group content and activity will only be visible to members. Unlike public and private groups, a hidden group is not listed in the groups directory or search results.</p>\n<p>Not all groups fit neatly into these three privacy options. That&#8217;s why BuddyPress core developer Mathieu Viet (<a href=\"https://twitter.com/imath\" target=\"_blank\">@imath</a>) has created a new experimental plugin to allow for a different combination of these settings.</p>\n<h3>Alternative Public Group Control</h3>\n<p>One problem with the way private groups are structured is that potential members cannot see any content or any of the other members in the group. This is a bit off putting and doesn&#8217;t help to attract new group members.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/06/private-group.png\" rel=\"prettyphoto[24769]\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/06/private-group.png?resize=900%2C442\" alt=\"private-group\" class=\"aligncenter size-full wp-image-24782\" /></a></p>\n<p>When examining the BuddyPress core, @imath found it difficult to override the way private groups are structured. Instead, he opted to extend public groups and the <a href=\"https://github.com/imath/altctrl-public-group\" target=\"_blank\">Alternative Public Group Control</a> plugin was born.</p>\n<p>This new experimental plugin gives admins more fine-grained control over public groups. It doesn&#8217;t override the group creation process but rather creates a new control tab within the group admin with three additional options.</p>\n<p>The first allows you to require users to request membership in order to join, a feature previously limited to private groups. The second option is the ability to make certain group tabs visible to members only, ie. members, docs, attachments, etc.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/group-admin-control.png\" rel=\"prettyphoto[24769]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/06/group-admin-control.png?resize=1025%2C775\" alt=\"group-admin-control\" class=\"aligncenter size-full wp-image-24785\" /></a></p>\n<p>The last option included in the plugin is the convenient way to create a simple custom homepage which will be displayed when non-members are viewing the group.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/custom-homepage.png\" rel=\"prettyphoto[24769]\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/custom-homepage.png?resize=900%2C377\" alt=\"custom-homepage\" class=\"aligncenter size-full wp-image-24787\" /></a></p>\n<p>This optional homepage space is useful if you want to further explain the process of joining the group or elaborate a bit more on what participation entails. Previously, the only place to do this was in the group&#8217;s description, which is better left short and sweet for its listing in the groups directory.</p>\n<p>The <a href=\"https://github.com/imath/altctrl-public-group\" target=\"_blank\">Alternative Public Group Control</a> plugin offers greater flexibility to groups with unique requirements. If you need more control over your groups and want to try out this plugin, your can download it from GitHub.  Be advised that it&#8217;s still experimental. If you have feedback, please send it to <a href=\"https://twitter.com/imath\" target=\"_blank\">@imath</a> by posting in the issues queue. Want to see the plugin in action without installing it? Check out the live demo video below:</p>\n<p></p>\n<p><a href=\"http://vimeo.com/98253453\">Alternative Control for BuddyPress public groups</a> from <a href=\"http://vimeo.com/imath\">imath</a> on <a href=\"https://vimeo.com\">Vimeo</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 16 Jun 2014 21:29:18 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:44;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"WordPress.tv: Aaron K. Altman: Migrating a Website with BackupBuddy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wordpress.tv/?p=35302\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"http://wordpress.tv/2014/06/16/aaron-k-altman-migrating-a-website-with-backupbuddy/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:688:\"<div 