nk\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"http://wordpress.tv/2014/06/16/michael-earley-unleash-your-design-potential-with-css-for-beginners/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:713:\"<div id=\"v-5yFXVjyO-1\" class=\"video-player\">\n</div><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/35829/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/35829/\" /></a> <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=35829&subd=wptv&ref=&feed=1\" width=\"1\" height=\"1\" /><div><a href=\"http://wordpress.tv/2014/06/16/michael-earley-unleash-your-design-potential-with-css-for-beginners/\"><img alt=\"Michael Earley: Unleash Your Design Potential with CSS for Beginners\" src=\"http://videos.videopress.com/5yFXVjyO/video-6df76b552a_std.original.jpg\" width=\"160\" height=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 16 Jun 2014 18:04:05 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"WordPress.tv\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:47;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"WPTavern: WordPress Trunk Adds New Beta Testing Tab to Plugins Screen\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=24751\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:182:\"http://wptavern.com/wordpress-trunk-adds-new-beta-testing-tab-to-plugins-screen?utm_source=rss&utm_medium=rss&utm_campaign=wordpress-trunk-adds-new-beta-testing-tab-to-plugins-screen\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2202:\"<p>If you&#8217;re running WordPress <a href=\"https://core.trac.wordpress.org/browser/trunk\" target=\"_blank\">trunk</a>, then you may have noticed a new addition to the plugins screen. A &#8220;Beta Testing&#8221; tab now lists all available <a href=\"http://make.wordpress.org/core/features-as-plugins/\" target=\"_blank\">Feature Plugins</a> that are currently ready for testing, including the WP API, Press This, and WordPress Frontend Editor plugins.</p>\n<div id=\"attachment_24758\" class=\"wp-caption aligncenter\"><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/beta-testing.png\" rel=\"prettyphoto[24751]\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/beta-testing.png?resize=1025%2C555\" alt=\"photo credit: Ryan McCue\" class=\"size-full wp-image-24758\" /></a><p class=\"wp-caption-text\">photo credit: Ryan McCue</p></div>\n<p>Andrew Nacin <a href=\"https://core.trac.wordpress.org/ticket/28513\" target=\"_blank\">added the tab</a> to all development builds of WordPress. To be clear, this is a tab meant only for those who are testing the plugins with the bleeding edge versions of WordPress and it will not be rolled into the next release. The Beta Testing tab is also visible if you&#8217;re using develop.svn/git.wordpress.org, even if you&#8217;re running a stable version of these builds. He chose to omit the WordPress Beta Tester plugin, given that you&#8217;re probably already on a beta track if you can view the new tab.</p>\n<p><strong>&#8220;I could also see us adding a &#8216;Development&#8217; tab that lists plugins like Debug Bar and Log Deprecated Notices. (Again, only if not on a stable build),&#8221;</strong> Nacin noted in the ticket. This could be very convenient for developers who want to quickly grab recommended tools, instead of having to remember and search them all individually.</p>\n<p>The new Beta Testing tab is a welcome addition and will hopefully get more eyes on new features that are in development for future releases. As long as the screen is regularly updated, developers running WordPress trunk will always know which feature plugins have testing versions available, without having to subscribe to all the development updates.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 16 Jun 2014 16:15:01 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:48;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"WordPress.tv: Chris Ford: UX and WP Product Design\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wordpress.tv/?p=35764\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"http://wordpress.tv/2014/06/15/chr